C%D0%BF%D0%B5%D1%80%D0%B0%D1%82%D0%BE%D1%80_%D0%94%D0%B7%D0%B8%D0%BC%D0%BC%D1%83\" title=\"\u0418\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440 \u0414\u0437\u0438\u043c\u043c\u0443\">\u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u0430 \u0414\u0437\u0438\u043c\u043c\u0443<\/a> \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B0%D1%82%D0%BE%D1%80%D0%BE%D0%B2_%D0%AF%D0%BF%D0%BE%D0%BD%D0%B8%D0%B8\" title=\"\u0421\u043f\u0438\u0441\u043e\u043a \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u043e\u0432 \u042f\u043f\u043e\u043d\u0438\u0438\">\u0442\u0440\u043e\u043d \u042f\u043f\u043e\u043d\u0438\u0438<\/a>. \u0421\u043e\u0437\u0434\u0430\u043d\u0438\u0435 \u044f\u043f\u043e\u043d\u0441\u043a\u043e\u0433\u043e \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/55_%D0%B3%D0%BE%D0%B4\" title=\"55 \u0433\u043e\u0434\">55<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%BD%D0%B8%D0%BA\" title=\"\u0411\u0440\u0438\u0442\u0430\u043d\u043d\u0438\u043a\">\u0422\u0438\u0431\u0435\u0440\u0438\u0439 \u041a\u043b\u0430\u0432\u0434\u0438\u0439 \u0426\u0435\u0437\u0430\u0440\u044c \u0411\u0440\u0438\u0442\u0430\u043d\u043d\u0438\u043a<\/a>, \u0441\u044b\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B8%D0%BC%D1%81%D0%BA%D0%B8%D0%B9_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B0%D1%82%D0%BE%D1%80\" class=\"mw-redirect\" title=\"\u0420\u0438\u043c\u0441\u043a\u0438\u0439 \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\">\u0440\u0438\u043c\u0441\u043a\u043e\u0433\u043e \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BB%D0%B0%D0%B2%D0%B4%D0%B8%D0%B9\" title=\"\u041a\u043b\u0430\u0432\u0434\u0438\u0439\">\u041a\u043b\u0430\u0432\u0434\u0438\u044f<\/a>, \u0431\u044b\u043b \u043e\u0442\u0440\u0430\u0432\u043b\u0435\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B5%D1%80%D0%BE%D0%BD\" title=\"\u041d\u0435\u0440\u043e\u043d\">\u041d\u0435\u0440\u043e\u043d\u043e\u043c<\/a>, \u0441 \u043f\u043e\u043c\u043e\u0449\u044c\u044e \u0437\u043d\u0430\u043c\u0435\u043d\u0438\u0442\u043e\u0439 \u043e\u0442\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u043d\u0438\u0446\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D0%BA%D1%83%D1%81%D1%82%D0%B0\" title=\"\u041b\u043e\u043a\u0443\u0441\u0442\u0430\">\u041b\u043e\u043a\u0443\u0441\u0442\u044b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/244_%D0%B3%D0%BE%D0%B4\" title=\"244 \u0433\u043e\u0434\">244<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D1%81%D0%BE%D0%BF%D0%BE%D1%82%D0%B0%D0%BC%D0%B8%D1%8F\" title=\"\u041c\u0435\u0441\u043e\u043f\u043e\u0442\u0430\u043c\u0438\u044f\">\u041c\u0435\u0441\u043e\u043f\u043e\u0442\u0430\u043c\u0438\u0438<\/a>, \u043f\u043e \u043f\u0440\u0438\u043a\u0430\u0437\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%B8%D0%BB%D0%B8%D0%BF%D0%BF_%D0%90%D1%80%D0%B0%D0%B1\" class=\"mw-redirect\" title=\"\u0424\u0438\u043b\u0438\u043f\u043f \u0410\u0440\u0430\u0431\">\u0424\u0438\u043b\u0438\u043f\u043f\u0430 \u0410\u0440\u0430\u0431\u0430<\/a>, \u0442\u0430\u0439\u043d\u043e \u0443\u0431\u0438\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B8%D0%BC%D1%81%D0%BA%D0%B8%D0%B9_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B0%D1%82%D0%BE%D1%80\" class=\"mw-redirect\" title=\"\u0420\u0438\u043c\u0441\u043a\u0438\u0439 \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\">\u0440\u0438\u043c\u0441\u043a\u0438\u0439 \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D1%80%D0%B4%D0%B8%D0%B0%D0%BD_III\" title=\"\u0413\u043e\u0440\u0434\u0438\u0430\u043d III\">\u0413\u043e\u0440\u0434\u0438\u0430\u043d III<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/435_%D0%B3%D0%BE%D0%B4\" title=\"435 \u0433\u043e\u0434\">435<\/a>&#160;\u2014 \u0410\u0444\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0435 \u0437\u0430\u0432\u043e\u0435\u0432\u0430\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D1%80%D0%BE%D0%BB%D0%B5%D0%B2%D1%81%D1%82%D0%B2%D0%BE_%D0%B2%D0%B0%D0%BD%D0%B4%D0%B0%D0%BB%D0%BE%D0%B2_%D0%B8_%D0%B0%D0%BB%D0%B0%D0%BD%D0%BE%D0%B2\" title=\"\u041a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u0442\u0432\u043e \u0432\u0430\u043d\u0434\u0430\u043b\u043e\u0432 \u0438 \u0430\u043b\u0430\u043d\u043e\u0432\">\u0432\u0430\u043d\u0434\u0430\u043b\u043e\u0432<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D0%B9%D0%B7%D0%B5%D1%80%D0%B8%D1%85\" title=\"\u0413\u0435\u0439\u0437\u0435\u0440\u0438\u0445\">\u0413\u0435\u0439\u0437\u0435\u0440\u0438\u0445\u0430<\/a> \u0431\u044b\u043b\u0438 \u043f\u0440\u0438\u0437\u043d\u0430\u043d\u044b \u043f\u043e \u043c\u0438\u0440\u043d\u043e\u043c\u0443 \u0434\u043e\u0433\u043e\u0432\u043e\u0440\u0443 \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D0%BB%D0%B5%D0%BD%D1%82%D0%B8%D0%BD%D0%B8%D0%B0%D0%BD_III\" title=\"\u0412\u0430\u043b\u0435\u043d\u0442\u0438\u043d\u0438\u0430\u043d III\">\u0412\u0430\u043b\u0435\u043d\u0442\u0438\u043d\u0438\u0430\u043d\u043e\u043c III<\/a>. \u0412\u0430\u043d\u0434\u0430\u043b\u044b \u043f\u043e\u043b\u0443\u0447\u0438\u043b\u0438 \u0432\u043e \u0432\u043b\u0430\u0434\u0435\u043d\u0438\u0435 \u0432\u043e\u0441\u0442\u043e\u0447\u043d\u0443\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%B2%D1%80%D0%B5%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u041c\u0430\u0432\u0440\u0435\u0442\u0430\u043d\u0438\u044f\">\u041c\u0430\u0432\u0440\u0435\u0442\u0430\u043d\u0438\u044e<\/a> \u0441 \u0447\u0430\u0441\u0442\u044c\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D1%83%D0%BC%D0%B8%D0%B4%D0%B8%D1%8F\" title=\"\u041d\u0443\u043c\u0438\u0434\u0438\u044f\">\u041d\u0443\u043c\u0438\u0434\u0438\u0438<\/a>, \u043d\u043e \u043e\u0431\u044f\u0437\u0430\u043b\u0438\u0441\u044c \u0432\u0437\u0430\u043c\u0435\u043d \u043f\u043b\u0430\u0442\u0438\u0442\u044c \u0435\u0436\u0435\u0433\u043e\u0434\u043d\u0443\u044e \u0434\u0430\u043d\u044c \u0438\u043c\u043f\u0435\u0440\u0438\u0438 \u0438 \u0437\u0430\u0449\u0438\u0449\u0430\u0442\u044c \u0433\u0440\u0430\u043d\u0438\u0446\u044b \u043e\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D1%80%D0%B1%D0%B5%D1%80%D1%8B\" title=\"\u0411\u0435\u0440\u0431\u0435\u0440\u044b\">\u0431\u0435\u0440\u0431\u0435\u0440\u043e\u0432<\/a> \u0432 \u043a\u0430\u0447\u0435\u0441\u0442\u0432\u0435 \u0444\u0435\u0434\u0435\u0440\u0430\u0442\u043e\u0432. \u0413\u0435\u0439\u0437\u0435\u0440\u0438\u0445 \u043e\u0442\u0434\u0430\u043b \u0437\u0430\u043b\u043e\u0436\u043d\u0438\u043a\u043e\u043c \u0432 \u0420\u0438\u043c \u0441\u0432\u043e\u0435\u0433\u043e \u0441\u044b\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%83%D0%BD%D0%B5%D1%80%D0%B8%D1%85\" class=\"mw-redirect\" title=\"\u0413\u0443\u043d\u0435\u0440\u0438\u0445\">\u0413\u0443\u043d\u0435\u0440\u0438\u0445\u0430<\/a>, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u0432\u0441\u043a\u043e\u0440\u0435 \u0432\u0435\u0440\u043d\u0443\u043b\u0441\u044f.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1115_%D0%B3%D0%BE%D0%B4\" title=\"1115 \u0433\u043e\u0434\">1115<\/a>&#160;\u2014 \u0412\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435 \u0440\u0435\u0439\u043d\u0441\u043a\u0438\u0445 \u0438 \u0432\u0435\u0441\u0442\u0444\u0430\u043b\u044c\u0441\u043a\u0438\u0445 \u043a\u043d\u044f\u0437\u0435\u0439: <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BC%D0%BF%D0%B5%D1%80%D0%B0%D1%82%D0%BE%D1%80_%D0%A1%D0%B2%D1%8F%D1%89%D0%B5%D0%BD%D0%BD%D0%BE%D0%B9_%D0%A0%D0%B8%D0%BC%D1%81%D0%BA%D0%BE%D0%B9_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D0%B8\" class=\"mw-redirect\" title=\"\u0418\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440 \u0421\u0432\u044f\u0449\u0435\u043d\u043d\u043e\u0439 \u0420\u0438\u043c\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0438\">\u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440 \u0421\u0432\u044f\u0449\u0435\u043d\u043d\u043e\u0439 \u0420\u0438\u043c\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D0%BD%D1%80%D0%B8%D1%85_V_(%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B0%D1%82%D0%BE%D1%80_%D0%A1%D0%B2%D1%8F%D1%89%D0%B5%D0%BD%D0%BD%D0%BE%D0%B9_%D0%A0%D0%B8%D0%BC%D1%81%D0%BA%D0%BE%D0%B9_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D0%B8)\" title=\"\u0413\u0435\u043d\u0440\u0438\u0445 V (\u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440 \u0421\u0432\u044f\u0449\u0435\u043d\u043d\u043e\u0439 \u0420\u0438\u043c\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0438)\">\u0413\u0435\u043d\u0440\u0438\u0445 V<\/a> \u0431\u044b\u043b \u043f\u043e\u0431\u0435\u0436\u0434\u0435\u043d <a href=\"https:\/\/de.wikipedia.org\/wiki\/Schlacht_am_Welfesholz\" class=\"extiw\" title=\"de:Schlacht am Welfesholz\">\u0432 \u0431\u0438\u0442\u0432\u0435<\/a> \u043f\u0440\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D1%8C%D1%84%D0%B5%D1%81%D1%85%D0%BE%D0%BB%D1%8C%D1%86\" title=\"\u0412\u0435\u043b\u044c\u0444\u0435\u0441\u0445\u043e\u043b\u044c\u0446\">\u0412\u0435\u043b\u044c\u0444\u0435\u0441\u0445\u043e\u043b\u044c\u0446\u0435<\/a>, \u0443 \u0412\u0435\u043b\u044c\u0444\u0441\u043a\u043e\u0433\u043e \u043b\u0435\u0441\u0430 \u043d\u0430 \u0440\u0435\u043a\u0435 <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%92%D0%B8%D0%BF%D0%BF%D0%B5%D1%80_(%D0%BF%D1%80%D0%B8%D1%82%D0%BE%D0%BA_%D0%97%D0%B0%D0%BB%D0%B5)&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0412\u0438\u043f\u043f\u0435\u0440 (\u043f\u0440\u0438\u0442\u043e\u043a \u0417\u0430\u043b\u0435) (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0412\u0438\u043f\u043f\u0435\u0440<\/a> \u043f\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%BD%D1%81%D1%84%D0%B5%D0%BB%D1%8C%D0%B4_(%D0%B3%D0%BE%D1%80%D0%BE%D0%B4)\" title=\"\u041c\u0430\u043d\u0441\u0444\u0435\u043b\u044c\u0434 (\u0433\u043e\u0440\u043e\u0434)\">\u041c\u0430\u043d\u0441\u0444\u0435\u043b\u044c\u0434\u043e\u043c<\/a>. \u0415\u0433\u043e \u0432\u043e\u0435\u043d\u0430\u0447\u0430\u043b\u044c\u043d\u0438\u043a <a href=\"https:\/\/de.wikipedia.org\/wiki\/Hoyer_I._von_Mansfeld\" class=\"extiw\" title=\"de:Hoyer I. von Mansfeld\">\u0425\u043e\u0439\u0435\u0440 \u0444\u043e\u043d \u041c\u0430\u043d\u0441\u0444\u0435\u043b\u044c\u0434<\/a> \u043f\u043e\u0433\u0438\u0431 \u0432 \u044d\u0442\u043e\u043c \u0431\u043e\u044e, \u0430 \u0441\u0430\u043c \u0413\u0435\u043d\u0440\u0438\u0445 \u0432\u044b\u043d\u0443\u0436\u0434\u0435\u043d \u0431\u044b\u043b \u0431\u0435\u0436\u0430\u0442\u044c \u0438\u0437 \u0421\u0430\u043a\u0441\u043e\u043d\u0438\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1234\" class=\"mw-redirect\" title=\"1234\">1234<\/a>&#160;\u2014 \u0412 \u0445\u043e\u0434\u0435 \u043f\u043e\u0445\u043e\u0434\u043e\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D0%B2%D0%BE%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%BE%D1%80%D0%B4%D0%B5%D0%BD\" title=\"\u041b\u0438\u0432\u043e\u043d\u0441\u043a\u0438\u0439 \u043e\u0440\u0434\u0435\u043d\">\u0433\u0435\u0440\u043c\u0430\u043d\u0441\u043a\u0438\u0445 \u043a\u0440\u0435\u0441\u0442\u043e\u043d\u043e\u0441\u0446\u0435\u0432<\/a>, \u0446\u0435\u043b\u044c\u044e \u043a\u043e\u0442\u043e\u0440\u044b\u0445 \u0431\u044b\u043b\u043e \u0437\u0430\u0432\u043e\u0435\u0432\u0430\u043d\u0438\u0435 \u0438 \u043d\u0430\u0441\u0438\u043b\u044c\u0441\u0442\u0432\u0435\u043d\u043d\u0430\u044f \u0445\u0440\u0438\u0441\u0442\u0438\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0438 \u043f\u0440\u0438\u0431\u0430\u043b\u0442\u0438\u0439\u0441\u043a\u0438\u0445 \u043f\u043b\u0435\u043c\u0451\u043d (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%83%D1%80%D1%88%D0%B8\" title=\"\u041a\u0443\u0440\u0448\u0438\">\u043a\u0443\u0440\u0448\u0435\u0439<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D0%B2%D1%8B\" title=\"\u041b\u0438\u0432\u044b\">\u043b\u0438\u0432\u043e\u0432<\/a> \u0438&#160;\u0442.&#160;\u0434.), \u0441\u043e\u0437\u0434\u0430\u043d\u043e \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0435 \u0434\u0443\u0445\u043e\u0432\u043d\u043e\u0435 \u043a\u043d\u044f\u0436\u0435\u0441\u0442\u0432\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%83%D1%80%D0%BB%D1%8F%D0%BD%D0%B4%D1%81%D0%BA%D0%BE%D0%B5_%D0%B5%D0%BF%D0%B8%D1%81%D0%BA%D0%BE%D0%BF%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u041a\u0443\u0440\u043b\u044f\u043d\u0434\u0441\u043a\u043e\u0435 \u0435\u043f\u0438\u0441\u043a\u043e\u043f\u0441\u0442\u0432\u043e\">\u041a\u0443\u0440\u043b\u044f\u043d\u0434\u0441\u043a\u043e\u0435 \u0435\u043f\u0438\u0441\u043a\u043e\u043f\u0441\u0442\u0432\u043e<\/a>. \u0421\u0442\u043e\u043b\u0438\u0446\u0435\u0439 \u0435\u043f\u0438\u0441\u043a\u043e\u043f\u0438\u0438 \u0441\u0442\u0430\u043b \u0433. <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B8%D0%BB%D1%82%D0%B5%D0%BD%D0%B5\" title=\"\u041f\u0438\u043b\u0442\u0435\u043d\u0435\">\u041f\u0438\u043b\u0442\u0435\u043d\u0435<\/a> (\u0440\u0430\u043d\u0435\u0435 \u043d\u0435\u043c. <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B8%D0%BB%D1%8C%D1%82%D0%B5%D0%BD\" class=\"mw-redirect\" title=\"\u041f\u0438\u043b\u044c\u0442\u0435\u043d\">\u041f\u0438\u043b\u044c\u0442\u0435\u043d<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1573\" class=\"mw-redirect\" title=\"1573\">1573<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%83%D0%B3%D0%B5%D0%BD%D0%BE%D1%82%D1%81%D0%BA%D0%B8%D0%B5_%D0%B2%D0%BE%D0%B9%D0%BD%D1%8B\" class=\"mw-redirect\" title=\"\u0413\u0443\u0433\u0435\u043d\u043e\u0442\u0441\u043a\u0438\u0435 \u0432\u043e\u0439\u043d\u044b\">\u0413\u0443\u0433\u0435\u043d\u043e\u0442\u0441\u043a\u0438\u0435 \u0432\u043e\u0439\u043d\u044b<\/a>: \u043a\u0430\u0442\u043e\u043b\u0438\u0447\u0435\u0441\u043a\u0438\u0435 \u0432\u043e\u0439\u0441\u043a\u0430 \u043d\u0430\u0447\u0438\u043d\u0430\u044e\u0442 <a href=\"https:\/\/fr.wikipedia.org\/wiki\/Si%C3%A8ge_de_La_Rochelle_(1573)\" class=\"extiw\" title=\"fr:Si\u00e8ge de La Rochelle (1573)\">\u043e\u0441\u0430\u0434\u0443 \u041b\u0430-\u0420\u043e\u0448\u0435\u043b\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1626\" class=\"mw-redirect\" title=\"1626\">1626<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B5%D0%B3%D1%83%D1%81\" title=\"\u041d\u0435\u0433\u0443\u0441\">\u041d\u0435\u0433\u0443\u0441<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D1%84%D0%B8%D0%BE%D0%BF%D0%B8%D1%8F\" title=\"\u042d\u0444\u0438\u043e\u043f\u0438\u044f\">\u042d\u0444\u0438\u043e\u043f\u0438\u0438<\/a> \u0421\u0443\u0441\u043d\u044b\u0439\u043e\u0441\u0435 \u0438 \u043f\u0430\u0442\u0440\u0438\u0430\u0440\u0445 \u0410\u043b\u044c\u0444\u043e\u043d\u0441\u043e \u041c\u0435\u043d\u0434\u0435\u0441 \u043e\u0431\u044a\u044f\u0432\u043b\u044f\u044e\u0442 \u043e \u043f\u043e\u0434\u0447\u0438\u043d\u0435\u043d\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D1%84%D0%B8%D0%BE%D0%BF%D1%81%D0%BA%D0%B0%D1%8F_%D0%BF%D1%80%D0%B0%D0%B2%D0%BE%D1%81%D0%BB%D0%B0%D0%B2%D0%BD%D0%B0%D1%8F_%D1%86%D0%B5%D1%80%D0%BA%D0%BE%D0%B2%D1%8C\" title=\"\u042d\u0444\u0438\u043e\u043f\u0441\u043a\u0430\u044f \u043f\u0440\u0430\u0432\u043e\u0441\u043b\u0430\u0432\u043d\u0430\u044f \u0446\u0435\u0440\u043a\u043e\u0432\u044c\">\u044d\u0444\u0438\u043e\u043f\u0441\u043a\u043e\u0439 \u043f\u0440\u0430\u0432\u043e\u0441\u043b\u0430\u0432\u043d\u043e\u0439 \u0446\u0435\u0440\u043a\u0432\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B2%D1%8F%D1%82%D0%BE%D0%B9_%D0%9