li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1840\" class=\"mw-redirect\" title=\"1840\">1840<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%B8%D0%B6\" title=\"\u041f\u0430\u0440\u0438\u0436\">\u041f\u0430\u0440\u0438\u0436\u0435<\/a>, \u0432 \u0442\u0435\u0430\u0442\u0440\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%BF%D0%B5%D1%80%D0%B0-%D0%BA%D0%BE%D0%BC%D0%B8%D0%BA\" class=\"mw-redirect\" title=\"\u041e\u043f\u0435\u0440\u0430-\u043a\u043e\u043c\u0438\u043a\">\u041e\u043f\u0435\u0440\u0430-\u043a\u043e\u043c\u0438\u043a<\/a> \u043f\u0440\u043e\u0448\u043b\u0430 \u043f\u0440\u0435\u043c\u044c\u0435\u0440\u0430 \u043a\u043e\u043c\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u043e\u043f\u0435\u0440\u044b \u0432 \u0434\u0432\u0443\u0445 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f\u0445 \u0438\u0442\u0430\u043b\u044c\u044f\u043d\u0441\u043a\u043e\u0433\u043e \u043a\u043e\u043c\u043f\u043e\u0437\u0438\u0442\u043e\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B0%D1%8D%D1%82%D0%B0%D0%BD%D0%BE_%D0%94%D0%BE%D0%BD%D0%B8%D1%86%D0%B5%D1%82%D1%82%D0%B8\" class=\"mw-redirect\" title=\"\u0413\u0430\u044d\u0442\u0430\u043d\u043e \u0414\u043e\u043d\u0438\u0446\u0435\u0442\u0442\u0438\">\u0413\u0430\u044d\u0442\u0430\u043d\u043e \u0414\u043e\u043d\u0438\u0446\u0435\u0442\u0442\u0438<\/a>, \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%BE%D1%87%D1%8C_%D0%BF%D0%BE%D0%BB%D0%BA%D0%B0\" title=\"\u0414\u043e\u0447\u044c \u043f\u043e\u043b\u043a\u0430\">\u0414\u043e\u0447\u044c \u043f\u043e\u043b\u043a\u0430<\/a>\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1855\" class=\"mw-redirect\" title=\"1855\">1855<\/a>&#160;\u2014 \u0421\u044b\u043d \u043c\u0435\u043b\u043a\u043e\u043f\u043e\u043c\u0435\u0441\u0442\u043d\u043e\u0433\u043e \u0444\u0435\u043e\u0434\u0430\u043b\u0430 \u0438\u0437 \u041a\u0443\u0430\u0440\u044b, \u041a\u0430\u0441\u0430, \u043e\u0431\u044a\u044f\u0432\u0438\u043b \u0441\u0435\u0431\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B5%D0%B3%D1%83%D1%81\" title=\"\u041d\u0435\u0433\u0443\u0441\">\u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u043e\u043c \u042d\u0444\u0438\u043e\u043f\u0438\u0438<\/a> \u043f\u043e\u0434 \u0438\u043c\u0435\u043d\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B5%D0%BE%D0%B4%D1%80%D0%BE%D1%81_II\" title=\"\u0422\u0435\u043e\u0434\u0440\u043e\u0441 II\">\u0422\u0435\u043e\u0434\u0440\u043e\u0441 II<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1858\" class=\"mw-redirect\" title=\"1858\">1858<\/a>&#160;\u2014 \u041f\u0435\u0440\u0432\u043e\u0435 \u044f\u0432\u043b\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B5%D0%B2%D0%B0_%D0%9C%D0%B0%D1%80%D0%B8%D1%8F\" class=\"mw-redirect\" title=\"\u0414\u0435\u0432\u0430 \u041c\u0430\u0440\u0438\u044f\">\u0414\u0435\u0432\u044b \u041c\u0430\u0440\u0438\u0438<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%83%D1%80%D0%B4\" title=\"\u041b\u0443\u0440\u0434\">\u041b\u0443\u0440\u0434\u0435<\/a>. 14-\u043b\u0435\u0442\u043d\u044f\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%83%D0%B1%D0%B8%D1%80%D1%83,_%D0%91%D0%B5%D1%80%D0%BD%D0%B0%D0%B4%D0%B5%D1%82%D1%82%D0%B0\" title=\"\u0421\u0443\u0431\u0438\u0440\u0443, \u0411\u0435\u0440\u043d\u0430\u0434\u0435\u0442\u0442\u0430\">\u0411\u0435\u0440\u043d\u0430\u0434\u0435\u0442\u0442\u0430 \u0421\u0443\u0431\u0438\u0440\u0443<\/a> \u0441\u043e\u0431\u0438\u0440\u0430\u043b\u0430 \u0434\u0440\u043e\u0432\u0430 \u0438 \u043a\u043e\u0441\u0442\u0438 \u0434\u043b\u044f \u0441\u0442\u0430\u0440\u044c\u0451\u0432\u0449\u0438\u0446\u044b \u043d\u0435\u043f\u043e\u0434\u0430\u043b\u0451\u043a\u0443 \u043e\u0442 \u041b\u0443\u0440\u0434\u0430, \u043a\u043e\u0433\u0434\u0430 \u0432\u0434\u0440\u0443\u0433 \u0437\u0430\u043c\u0435\u0442\u0438\u043b\u0430, \u0447\u0442\u043e \u043d\u0430\u0445\u043e\u0434\u044f\u0449\u0438\u0439\u0441\u044f \u0440\u044f\u0434\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%BE%D1%82\" title=\"\u0413\u0440\u043e\u0442\">\u0433\u0440\u043e\u0442<\/a> \u043e\u0437\u0430\u0440\u0451\u043d \u0441\u0432\u0435\u0442\u043e\u043c, \u0430 \u043a\u0443\u0441\u0442 \u0448\u0438\u043f\u043e\u0432\u043d\u0438\u043a\u0430 \u0443 \u0432\u0445\u043e\u0434\u0430 \u043a\u043e\u043b\u044b\u0448\u0435\u0442\u0441\u044f, \u043a\u0430\u043a \u0431\u0443\u0434\u0442\u043e \u043e\u0442 \u0432\u0435\u0442\u0440\u0430. \u0412 \u043e\u0441\u0432\u0435\u0449\u0451\u043d\u043d\u043e\u043c \u0433\u0440\u043e\u0442\u0435 \u0411\u0435\u0440\u043d\u0430\u0434\u0435\u0442\u0442\u0430 \u0443\u0432\u0438\u0434\u0435\u043b\u0430, \u043a\u0430\u043a \u043e\u043d\u0430 \u0433\u043e\u0432\u043e\u0440\u0438\u043b\u0430 \u0432\u043f\u043e\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u0438 \u00ab\u0447\u0442\u043e-\u0442\u043e \u0431\u0435\u043b\u043e\u0435, \u043f\u043e\u0445\u043e\u0436\u0435\u0435 \u043d\u0430 \u0431\u0430\u0440\u044b\u0448\u043d\u044e\u00bb. \u0412 \u043f\u043e\u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0438\u0435 \u043d\u0435\u0441\u043a\u043e\u043b\u044c\u043a\u043e \u043c\u0435\u0441\u044f\u0446\u0435\u0432 \u0432\u043f\u043b\u043e\u0442\u044c \u0434\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/16_%D0%B8%D1%8E%D0%BB%D1%8F\" title=\"16 \u0438\u044e\u043b\u044f\">16 \u0438\u044e\u043b\u044f<\/a> \u0411\u0435\u0440\u043d\u0430\u0434\u0435\u0442\u0442\u0430 \u0435\u0449\u0451 17 \u0440\u0430\u0437 \u043b\u0438\u0446\u0435\u0437\u0440\u0435\u043b\u0430 \u0432\u0438\u0434\u0435\u043d\u0438\u0435 \u0432 \u0433\u0440\u043e\u0442\u0435. \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1862_%D0%B3%D0%BE%D0%B4\" title=\"1862 \u0433\u043e\u0434\">1862 \u0433\u043e\u0434\u0443<\/a> \u044f\u0432\u043b\u0435\u043d\u0438\u044f \u0431\u044b\u043b\u0438 \u043e\u0444\u0438\u0446\u0438\u0430\u043b\u044c\u043d\u043e \u043f\u0440\u0438\u0437\u043d\u0430\u043d\u044b. \u041c\u0435\u0441\u0442\u043e \u044f\u0432\u043b\u0435\u043d\u0438\u044f \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u044b \u0441\u0432. \u0411\u0435\u0440\u043d\u0430\u0434\u0435\u0442\u0442\u0435 \u043f\u0440\u0435\u0432\u0440\u0430\u0442\u0438\u043b\u043e\u0441\u044c \u0432 \u043e\u0434\u0438\u043d \u0438\u0437 \u0433\u043b\u0430\u0432\u043d\u044b\u0445 \u0446\u0435\u043d\u0442\u0440\u043e\u0432 \u043a\u0430\u0442\u043e\u043b\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u043f\u0430\u043b\u043e\u043c\u043d\u0438\u0447\u0435\u0441\u0442\u0432\u0430. \u0415\u0436\u0435\u0433\u043e\u0434\u043d\u043e \u0432 \u041b\u0443\u0440\u0434 \u043f\u0440\u0438\u0435\u0437\u0436\u0430\u0435\u0442 \u0434\u043e \u043f\u044f\u0442\u0438 \u043c\u0438\u043b\u043b\u0438\u043e\u043d\u043e\u0432 \u043f\u0430\u043b\u043e\u043c\u043d\u0438\u043a\u043e\u0432.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1873\" class=\"mw-redirect\" title=\"1873\">1873<\/a>&#160;\u2014 \u041f\u043e\u0441\u043b\u0435 \u043e\u0442\u0440\u0435\u0447\u0435\u043d\u0438\u044f \u043e\u0442 \u043f\u0440\u0435\u0441\u0442\u043e\u043b\u0430 \u0438\u0441\u043f\u0430\u043d\u0441\u043a\u043e\u0433\u043e \u043a\u043e\u0440\u043e\u043b\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BC%D0%B0%D0%B4%D0%B5%D0%B9_I_(%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D1%8C_%D0%98%D1%81%D0%BF%D0%B0%D0%BD%D0%B8%D0%B8)\" title=\"\u0410\u043c\u0430\u0434\u0435\u0439 I (\u043a\u043e\u0440\u043e\u043b\u044c \u0418\u0441\u043f\u0430\u043d\u0438\u0438)\">\u0410\u043c\u0430\u0434\u0435\u044f I<\/a>, \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u0435\u0434\u0448\u0435\u0433\u043e \u0432\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u0435 \u043e\u0441\u0442\u0440\u043e\u0433\u043e \u0441\u043e\u0446\u0438\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u043a\u0440\u0438\u0437\u0438\u0441\u0430 \u0438 \u043d\u0430\u0447\u0430\u0432\u0448\u0435\u0439\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%82%D0%BE%D1%80%D0%B0%D1%8F_%D0%BA%D0%B0%D1%80%D0%BB%D0%B8%D1%81%D1%82%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0412\u0442\u043e\u0440\u0430\u044f \u043a\u0430\u0440\u043b\u0438\u0441\u0442\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u0412\u0442\u043e\u0440\u043e\u0439 \u043a\u0430\u0440\u043b\u0438\u0441\u0442\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u044b<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D1%80%D1%82%D0%B5%D1%81%D1%8B\" title=\"\u041a\u043e\u0440\u0442\u0435\u0441\u044b\">\u041a\u043e\u0440\u0442\u0435\u0441\u0430\u043c\u0438<\/a> \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0448\u0435\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%80%D0%B2%D0%B0%D1%8F_%D0%98%D1%81%D0%BF%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0\" class=\"mw-redirect\" title=\"\u041f\u0435\u0440\u0432\u0430\u044f \u0418\u0441\u043f\u0430\u043d\u0441\u043a\u0430\u044f \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\">\u041f\u0435\u0440\u0432\u0430\u044f \u0418\u0441\u043f\u0430\u043d\u0441\u043a\u0430\u044f \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1889\" class=\"mw-redirect\" title=\"1889\">1889<\/a>&#160;\u2014 \u041f\u0440\u0438\u043d\u044f\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BD%D1%81%D1%82%D0%B8%D1%82%D1%83%D1%86%D0%B8%D1%8F_%D0%AF%D0%BF%D0%BE%D0%BD%D1%81%D0%BA%D0%BE%D0%B9_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D0%B8\" title=\"\u041a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u044f \u042f\u043f\u043e\u043d\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0438\">\u041a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u044f \u041c\u044d\u0439\u0434\u0437\u0438<\/a>, \u043a\u043e\u0442\u043e\u0440\u0430\u044f \u0443\u0441\u0442\u0430\u043d\u0430\u0432\u043b\u0438\u0432\u0430\u043b\u0430 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D0%BF%D0%BE%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u042f\u043f\u043e\u043d\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f\">\u042f\u043f\u043e\u043d\u0438\u0438<\/a> \u043a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u043e\u043d\u043d\u0443\u044e \u043c\u043e\u043d\u0430\u0440\u0445\u0438\u044e \u043f\u0440\u0443\u0441\u0441\u043a\u043e\u0433\u043e \u043e\u0431\u0440\u0430\u0437\u0446\u0430. \u0420\u0430\u0431\u043e\u0442\u0443 \u043d\u0430\u0434 \u043f\u0440\u043e\u0435\u043a\u0442\u043e\u043c \u041a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u0438 \u0432\u043e\u0437\u0433\u043b\u0430\u0432\u043b\u044f\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%82%D0%BE_%D0%A5%D0%B8%D1%80%D0%BE%D0%B1%D1%83%D0%BC%D0%B8\" title=\"\u0418\u0442\u043e \u0425\u0438\u0440\u043e\u0431\u0443\u043c\u0438\">\u0418\u0442\u043e \u0425\u0438\u0440\u043e\u0431\u0443\u043c\u0438<\/a>. \u041f\u043e\u0441\u043b\u0435 \u043f\u0440\u0438\u043d\u044f\u0442\u0438\u044f \u041a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u0438 \u0432 \u042f\u043f\u043e\u043d\u0438\u0438 \u043f\u043e\u044f\u0432\u0438\u043b\u0441\u044f \u043f\u0435\u0440\u0432\u044b\u0439 \u0432 \u0410\u0437\u0438\u0438 \u043f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1900\" class=\"mw-redirect\" title=\"1900\">1900<\/a><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%BE-%D0%B1%D1%83%D1%80%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0_(1899%E2%80%941902)\" title=\"\u0410\u043d\u0433\u043b\u043e-\u0431\u0443\u0440\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 (1899\u20141902)\">\u0412\u0442\u043e\u0440\u0430\u044f \u0430\u043d\u0433\u043b\u043e-\u0431\u0443\u0440\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430<\/a>: \u043f\u0435\u0440\u0435\u0439\u0434\u044f \u0432 \u043d\u0430\u0441\u0442\u0443\u043f\u043b\u0435\u043d\u0438\u0435, \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0435 \u0432\u043e\u0439\u0441\u043a\u0430 \u043e\u043a\u0440\u0443\u0436\u0438\u043b\u0438 \u0438 \u043f\u0440\u0438\u043d\u0443\u0434\u0438\u043b\u0438 \u043a \u043a\u0430\u043f\u0438\u0442\u0443\u043b\u044f\u0446\u0438\u0438 \u0430\u0440\u043c\u0438\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%80%D0%B0%D0%BD%D0%B6%D0%B5%D0%B2%D0%BE%D0%B5_%D0%A1%D0%B2%D0%BE%D0%B1%D0%BE%D0%B4%D0%BD%D0%BE%D0%B5_%D0%93%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u041e\u0440\u0430\u043d\u0436\u0435\u0432\u043e\u0435 \u0421\u0432\u043e\u0431\u043e\u0434\u043d\u043e\u0435 \u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u043e\">\u041e\u0440\u0430\u043d\u0436\u0435\u0432\u043e\u0439 \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0438<\/a> \u043f\u0440\u0438 <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%9F%D0%B0%D0%B0%D0%B4%D0%B5%D0%B1%D0%B5%D1%80%D0%B3&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u041f\u0430\u0430\u0434\u0435\u0431\u0435\u0440\u0433 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u041f\u0430\u0430\u0434\u0435\u0431\u0435\u0440\u0433\u0435<\/a>.<\/li><li>\u041d\u0430 III \u0441\u044a\u0435\u0437\u0434\u0435 \u0443\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u0438\u0445 \u0441\u0442\u0443\u0434\u0435\u043d\u0447\u0435\u0441\u043a\u0438\u0445 \u0433\u0440\u043e\u043c\u0430\u0434 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%B0%D1%80%D1%8C%D0%BA%D0%BE%D0%B2\" title=\"\u0425\u0430\u0440\u044c\u043a\u043e\u0432\">\u0425\u0430\u0440\u044c\u043a\u043e\u0432\u0435<\/a> \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D0%B2%D0%BE%D0%BB%D1%8E%D1%86%D0%B8%D0%BE%D0%BD%D0%BD%D0%B0%D1%8F_%D1%83%D0%BA%D1%80%D0%B0%D0%B8%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%BF%D0%B0%D1%80%D1%82%D0%B8%D1%8F\" title=\"\u0420\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u043e\u043d\u043d\u0430\u044f \u0443\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u0430\u044f \u043f\u0430\u0440\u0442\u0438\u044f\">\u0420\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u043e\u043d\u043d\u0430\u044f \u0443\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u0430\u044f \u043f\u0430\u0440\u0442\u0438\u044f<\/a>.<\/li><\/ul><\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1903_%D0%B3%D0%BE%D0%B4\" title=\"1903 \u0433\u043e\u0434\">1903<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BD%D0%B0\" title=\"\u0412\u0435\u043d\u0430\">\u0412\u0435\u043d\u0435<\/a> \u043f\u043e\u0434 \u0443\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%9B%D1%91%D0%B2%D0%B5,_%D0%A4%D0%B5%D1%80%D0%B4%D0%B8%D0%BD%D0%B0%D0%BD%D0%B4&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u041b\u0451\u0432\u0435, \u0424\u0435\u0440\u0434\u0438\u043d\u0430\u043d\u0434 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0424\u0435\u0440\u0434\u0438\u043d\u0430\u043d\u0434\u0430 \u041b\u0451\u0432\u0435<\/a> \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u0430\u0441\u044c \u043f\u0440\u0435\u043c\u044c\u0435\u0440\u0430 \u0441\u0438\u043c\u0444\u043e\u043d\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D1%83%D0%BA%D0%BD%D0%B5%D1%80,_%D0%90%D0%BD%D1%82%D0%BE%D0%BD\" title=\"\u0411\u0440\u0443\u043a\u043d\u0435\u0440, \u0410\u043d\u0442\u043e\u043d\">\u0410\u043d\u0442\u043e\u043d\u0430 \u0411\u0440\u0443\u043a\u043d\u0435\u0440\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B8%D0%BC%D1%84%D0%BE%D0%BD%D0%B8%D1%8F_%E2%84%96_9_(%D0%91%D1%80%D1%83%D0%BA%D0%BD%D0%B5%D1%80)\" title=\"\u0421\u0438\u043c\u0444\u043e\u043d\u0438\u044f \u2116 9 (\u0411\u0440\u0443\u043a\u043d\u0435\u0440)\">\u2116&#160;9 \u0440\u0435 \u043c\u0438\u043d\u043e\u0440<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1916_%D0%B3%D0%BE%D0%B4\" title=\"1916 \u0433\u043e\u0434\">1916<\/a>&#160;\u2014 \u0417\u0430 \u0440\u0430\u0441\u043f\u0440\u043e\u0441\u0442\u0440\u0430\u043d\u0435\u043d\u0438\u0435 \u043b\u0438\u0442\u0435\u0440\u0430\u0442\u0443\u0440\u044b \u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%BB%D0%B8%D1%82%D0%B8%D0%BA%D0%B0_%D0%BE%D0%B3%D1%80%D0%B0%D0%BD%D0%B8%D1%87%D0%B5%D0%BD%D0%B8%D1%8F_%D1%80%D0%BE%D0%B6%D0%B4%D0%B0%D0%B5%D0%BC%D0%BE%D1%81%D1%82%D0%B8\" title=\"\u041f\u043e\u043b\u0438\u0442\u0438\u043a\u0430 \u043e\u0433\u0440\u0430\u043d\u0438\u0447\u0435\u043d\u0438\u044f \u0440\u043e\u0436\u0434\u0430\u0435\u043c\u043e\u0441\u0442\u0438\">\u043a\u043e\u043d\u0442\u0440\u043e\u043b\u0435 \u043d\u0430\u0434 \u0440\u043e\u0436\u0434\u0430\u0435\u043c\u043e\u0441\u0442\u044c\u044e<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D1%8C%D1%8E-%D0%99%D0%BE%D1%80%D0%BA\" title=\"\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\">\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\u0435<\/a> \u0430\u0440\u0435\u0441\u0442\u043e\u0432\u0430\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D0%BB%D1%8C%D0%B4%D0%BC%D0%B0%D0%BD,_%D0%AD%D0%BC%D0%BC%D0%B0\" title=\"\u0413\u043e\u043b\u044c\u0434\u043c\u0430\u043d, \u042d\u043c\u043c\u0430\">\u041a\u0440\u0430\u0441\u043d\u0430\u044f \u042d\u043c\u043c\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1918_%D0%B3%D0%BE%D0%B4\" title=\"1918 \u0433\u043e\u0434\">1918<\/a>&#160;\u2014 \u0434\u0435\u043a\u0440\u0435\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B2%D0%B5%D1%82_%D0%BD%D0%B0%D1%80%D0%BE%D0%B4%D0%BD%D1%8B%D1%85_%D0%BA%D0%BE%D0%BC%D0%B8%D1%81%D1%81%D0%B0%D1%80%D0%BE%D0%B2_%D0%A0%D0%A1%D0%A4%D0%A1%D0%A0\" title=\"\u0421\u043e\u0432\u0435\u0442 \u043d\u0430\u0440\u043e\u0434\u043d\u044b\u0445 \u043a\u043e\u043c\u0438\u0441\u0441\u0430\u0440\u043e\u0432 \u0420\u0421\u0424\u0421\u0420\">\u0421\u041d\u041a<\/a> \u043e\u0431 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%B5%D0%BD%D0%BD%D0%BE-%D0%9C%D0%BE%D1%80%D1%81%D0%BA%D0%BE%D0%B9_%D0%A4%D0%BB%D0%BE%D1%82_%D0%A1%D0%A1%D0%A1%D0%A0\" title=\"\u0412\u043e\u0435\u043d\u043d\u043e-\u041c\u043e\u0440\u0441\u043a\u043e\u0439 \u0424\u043b\u043e\u0442 \u0421\u0421\u0421\u0420\">\u0420\u0430\u0431\u043e\u0447\u0435-\u041a\u0440\u0435\u0441\u0442\u044c\u044f\u043d\u0441\u043a\u043e\u0433\u043e \u041a\u0440\u0430\u0441\u043d\u043e\u0433\u043e \u0444\u043b\u043e\u0442\u0430 (\u0420\u041a\u041a\u0424)<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1921_%D0%B3%D0%BE%D0%B4\" title=\"1921 \u0433\u043e\u0434\">1921<\/a><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D0%B8%D0%B7%D0%B0%D1%86%D0%B8%D1%8F_%D0%93%D1%80%D1%83%D0%B7%D0%B8%D0%B8\" title=\"\u0421\u043e\u0432\u0435\u0442\u0438\u0437\u0430\u0446\u0438\u044f \u0413\u0440\u0443\u0437\u0438\u0438\">\u0421\u043e\u0432\u0435\u0442\u0438\u0437\u0430\u0446\u0438\u044f \u0413\u0440\u0443\u0437\u0438\u0438<\/a>: \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D1%80%D1%87%D0%B0%D0%BB%D1%8B\" title=\"\u0411\u043e\u0440\u0447\u0430\u043b\u044b\">\u0411\u043e\u0440\u0447\u0430\u043b\u0438\u043d\u0441\u043a\u043e\u043c<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%85%D0%B0%D0%BB%D0%BA%D0%B0%D0%BB%D0%B0%D0%BA%D1%81%D0%BA%D0%B8%D0%B9_%D1%83%D0%B5%D0%B7%D0%B4\" title=\"\u0410\u0445\u0430\u043b\u043a\u0430\u043b\u0430\u043a\u0441\u043a\u0438\u0439 \u0443\u0435\u0437\u0434\">\u0410\u0445\u0430\u043b\u043a\u0430\u043b\u0430\u043a\u0441\u043a\u043e\u043c<\/a> \u0443\u0435\u0437\u0434\u0430\u0445 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D1%83%D0%B7%D0%B8%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%94%D0%B5%D0%BC%D0%BE%D0%BA%D1%80%D0%B0%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0\" class=\"mw-redirect\" title=\"\u0413\u0440\u0443\u0437\u0438\u043d\u0441\u043a\u0430\u044f \u0414\u0435\u043c\u043e\u043a\u0440\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\">\u0413\u0440\u0443\u0437\u0438\u0438<\/a> \u043c\u0435\u0441\u0442\u043d\u044b\u0435 \u043a\u043e\u043c\u043c\u0443\u043d\u0438\u0441\u0442\u044b \u043f\u043e\u0434\u043d\u044f\u043b\u0438 \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435, \u0441\u043a\u043e\u043e\u0440\u0434\u0438\u043d\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u043e\u0435 \u0441 \u043a\u043e\u043c\u0430\u043d\u0434\u043e\u0432\u0430\u043d\u0438\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/11-%D1%8F_%D0%B0%D1%80%D0%BC%D0%B8%D1%8F_(%D0%A0%D0%9A%D0%9A%D0%90)\" title=\"11-\u044f \u0430\u0440\u043c\u0438\u044f (\u0420\u041a\u041a\u0410)\">11-\u0439 \u0430\u0440\u043c\u0438\u0438<\/a>. \u0411\u043e\u043b\u044c\u0448\u0435\u0432\u0438\u043a\u0430\u043c\u0438 \u0431\u044b\u043b\u0438 \u0437\u0430\u043d\u044f\u0442\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D1%80%D0%B8\" title=\"\u0413\u043e\u0440\u0438\">\u0413\u043e\u0440\u0438<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D1%83%D1%88%D0%B5%D1%82\" class=\"mw-redirect\" title=\"\u0414\u0443\u0448\u0435\u0442\">\u0414\u0443\u0448\u0435\u0442<\/a> \u0438 \u0432\u0435\u0441\u044c \u0411\u043e\u0440\u0447\u0430\u043b\u0438\u043d\u0441\u043a\u0438\u0439 \u0443\u0435\u0437\u0434.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D1%80%D1%85%D0%BD%D0%B5%D1%81%D0%B8%D0%BB%D0%B5%D0%B7%D1%81%D0%BA%D0%B8%D0%B9_%D0%BF%D0%BB%D0%B5%D0%B1%D0%B8%D1%81%D1%86%D0%B8%D1%82\" title=\"\u0412\u0435\u0440\u0445\u043d\u0435\u0441\u0438\u043b\u0435\u0437\u0441\u043a\u0438\u0439 \u043f\u043b\u0435\u0431\u0438\u0441\u0446\u0438\u0442\">\u0412\u0435\u0440\u0445\u043d\u0435\u0441\u0438\u043b\u0435\u0437\u0441\u043a\u0438\u0439 \u043f\u043b\u0435\u0431\u0438\u0441\u0446\u0438\u0442<\/a>: \u043d\u0430 \u043f\u0435\u0440\u0438\u043e\u0434 \u043f\u043e\u0434\u0433\u043e\u0442\u043e\u0432\u043a\u0438 \u0438 \u043f\u0440\u043e\u0432\u0435\u0434\u0435\u043d\u0438\u044f \u043f\u043b\u0435\u0431\u0438\u0441\u0446\u0438\u0442\u0430 \u0443\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u0435 \u0442\u0435\u0440\u0440\u0438\u0442\u043e\u0440\u0438\u0435\u0439 \u0432\u0437\u044f\u043b\u0430 \u043d\u0430 \u0441\u0435\u0431\u044f \u041c\u0435\u0436\u0441\u043e\u044e\u0437\u043d\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043a\u043e\u043c\u0438\u0441\u0441\u0438\u044f \u043f\u043e \u0443\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u044e \u0438 \u043f\u0440\u043e\u0432\u0435\u0434\u0435\u043d\u0438\u044e \u043f\u043b\u0435\u0431\u0438\u0441\u0446\u0438\u0442\u0430 \u0432 \u0412\u0435\u0440\u0445\u043d\u0435\u0439 \u0421\u0438\u043b\u0435\u0437\u0438\u0438, \u0441\u043e\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u043d\u0430\u044f \u0438\u0437 \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u0438\u0442\u0435\u043b\u0435\u0439 \u0424\u0440\u0430\u043d\u0446\u0438\u0438, \u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438 \u0438 \u0418\u0442\u0430\u043b\u0438\u0438, \u043f\u0440\u0435\u0434\u0441\u0435\u0434\u0430\u0442\u0435\u043b\u0435\u043c \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u0431\u044b\u043b \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0438\u0439 \u0434\u0438\u0432\u0438\u0437\u0438\u043e\u043d\u043d\u044b\u0439 \u0433\u0435\u043d\u0435\u0440\u0430\u043b \u0410\u043d\u0440\u0438 \u041b\u0435 \u0420\u043e\u043d.<\/li><li>\u041e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B0%D0%B2%D0%BE%D1%81%D0%BB%D0%B0%D0%B2%D0%BD%D0%B0%D1%8F_%D1%86%D0%B5%D1%80%D0%BA%D0%BE%D0%B2%D1%8C_%D0%A4%D0%B8%D0%BD%D0%BB%D1%8F%D0%BD%D0%B4%D0%B8%D0%B8\" class=\"mw-redirect\" title=\"\u041f\u0440\u0430\u0432\u043e\u0441\u043b\u0430\u0432\u043d\u0430\u044f \u0446\u0435\u0440\u043a\u043e\u0432\u044c \u0424\u0438\u043d\u043b\u044f\u043d\u0434\u0438\u0438\">\u0424\u0438\u043d\u043b\u044f\u043d\u0434\u0441\u043a\u0430\u044f \u0410\u0432\u0442\u043e\u043d\u043e\u043c\u043d\u0430\u044f \u041f\u0440\u0430\u0432\u043e\u0441\u043b\u0430\u0432\u043d\u0430\u044f \u0426\u0435\u0440\u043a\u043e\u0432\u044c<\/a> \u0432 \u0441\u043e\u0441\u0442\u0430\u0432\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%83%D1%81%D1%81%D0%BA%D0%B0%D1%8F_%D0%BF%D1%80%D0%B0%D0%B2%D0%BE%D1%81%D0%BB%D0%B0%D0%B2%D0%BD%D0%B0%D1%8F_%D1%86%D0%B5%D1%80%D0%BA%D0%BE%D0%B2%D1%8C\" title=\"\u0420\u0443\u0441\u0441\u043a\u0430\u044f \u043f\u0440\u0430\u0432\u043e\u0441\u043b\u0430\u0432\u043d\u0430\u044f \u0446\u0435\u0440\u043a\u043e\u0432\u044c\">\u0420\u0443\u0441\u0441\u043a\u043e\u0439 \u041f\u0440\u0430\u0432\u043e\u0441\u043b\u0430\u0432\u043d\u043e\u0439 \u0426\u0435\u0440\u043a\u0432\u0438<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1922_%D0%B3%D0%BE%D0%B4\" title=\"1922 \u0433\u043e\u0434\">1922<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%BD%D1%82%D0%B8%D0%BD%D0%B3,_%D0%A4%D1%80%D0%B5%D0%B4%D0%B5%D1%80%D0%B8%D0%BA\" title=\"\u0411\u0430\u043d\u0442\u0438\u043d\u0433, \u0424\u0440\u0435\u0434\u0435\u0440\u0438\u043a\">\u0424\u0440\u0435\u0434\u0435\u0440\u0438\u043a \u0411\u0430\u043d\u0442\u0438\u043d\u0433<\/a> \u043e\u0442\u043a\u0440\u044b\u0432\u0430\u0435\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BD%D1%81%D1%83%D0%BB%D0%B8%D0%BD\" title=\"\u0418\u043d\u0441\u0443\u043b\u0438\u043d\">\u0438\u043d\u0441\u0443\u043b\u0438\u043d<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1928_%D0%B3%D0%BE%D0%B4\" title=\"1928 \u0433\u043e\u0434\">1928<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9C%D0%BE%D1%80%D0%B8%D1%86\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041c\u043e\u0440\u0438\u0446\">\u0421\u0430\u043d\u043a\u0442-\u041c\u043e\u0440\u0438\u0446\u0435<\/a> \u043e\u0442\u043a\u0440\u044b\u043b\u0438\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B8%D0%BC%D0%BD%D0%B8%D0%B5_%D0%9E%D0%BB%D0%B8%D0%BC%D0%BF%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B5_%D0%B8%D0%B3%D1%80%D1%8B_1928\" title=\"\u0417\u0438\u043c\u043d\u0438\u0435 \u041e\u043b\u0438\u043c\u043f\u0438\u0439\u0441\u043a\u0438\u0435 \u0438\u0433\u0440\u044b 1928\">II \u0437\u0438\u043c\u043d\u0438\u0435 \u041e\u043b\u0438\u043c\u043f\u0438\u0439\u0441\u043a\u0438\u0435 \u0438\u0433\u0440\u044b<\/a>. \u041e\u0442\u043a\u0440\u044b\u043b \u0438\u0433\u0440\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D1%83%D0%BB%D1%8C%D1%82%D0%B5%D1%81,_%D0%AD%D0%B4%D0%BC%D1%83%D0%BD%D0%B4\" title=\"\u0428\u0443\u043b\u044c\u0442\u0435\u0441, \u042d\u0434\u043c\u0443\u043d\u0434\">\u042d\u0434\u043c\u0443\u043d\u0434 \u0428\u0443\u043b\u044c\u0442\u0435\u0441<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1929_%D0%B3%D0%BE%D0%B4\" title=\"1929 \u0433\u043e\u0434\">1929<\/a><ul><li>\u041f\u043e\u0434\u043f\u0438\u0441\u0430\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B0%D1%82%D0%B5%D1%80%D0%B0%D0%BD%D1%81%D0%BA%D0%B8%D0%B5_%D1%81%D0%BE%D0%B3%D0%BB%D0%B0%D1%88%D0%B5%D0%BD%D0%B8%D1%8F\" title=\"\u041b\u0430\u0442\u0435\u0440\u0430\u043d\u0441\u043a\u0438\u0435 \u0441\u043e\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u044f\">\u041b\u0430\u0442\u0435\u0440\u0430\u043d\u0441\u043a\u0438\u0445 \u0441\u043e\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u0439<\/a> \u043c\u0435\u0436\u0434\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D1%80%D0%BE%D0%BB%D0%B5%D0%B2%D1%81%D1%82%D0%B2%D0%BE_%D0%98%D1%82%D0%B0%D0%BB%D0%B8%D1%8F_(1861%E2%80%941946)\" title=\"\u041a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u0442\u0432\u043e \u0418\u0442\u0430\u043b\u0438\u044f (1861\u20141946)\">\u0438\u0442\u0430\u043b\u044c\u044f\u043d\u0441\u043a\u0438\u043c \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u043e\u043c<\/a> \u0432\u043e \u0433\u043b\u0430\u0432\u0435 \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D1%83%D1%81%D1%81%D0%BE%D0%BB%D0%B8%D0%BD%D0%B8,_%D0%91%D0%B5%D0%BD%D0%B8%D1%82%D0%BE\" title=\"\u041c\u0443\u0441\u0441\u043e\u043b\u0438\u043d\u0438, \u0411\u0435\u043d\u0438\u0442\u043e\">\u041c\u0443\u0441\u0441\u043e\u043b\u0438\u043d\u0438<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B2%D1%8F%D1%82%D0%BE%D0%B9_%D0%9F%D1%80%D0%B5%D1%81%D1%82%D0%BE%D0%BB\" title=\"\u0421\u0432\u044f\u0442\u043e\u0439 \u041f\u0440\u0435\u0441\u0442\u043e\u043b\">\u0421\u0432\u044f\u0442\u044b\u043c \u041f\u0440\u0435\u0441\u0442\u043e\u043b\u043e\u043c<\/a>. \u041f\u043e\u0434\u043f\u0438\u0441\u0430\u043d\u044b \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B0%D1%82%D0%B5%D1%80%D0%B0%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%B4%D0%B2%D0%BE%D1%80%D0%B5%D1%86\" title=\"\u041b\u0430\u0442\u0435\u0440\u0430\u043d\u0441\u043a\u0438\u0439 \u0434\u0432\u043e\u0440\u0435\u0446\">\u041b\u0430\u0442\u0435\u0440\u0430\u043d\u0441\u043a\u043e\u043c \u0414\u0432\u043e\u0440\u0446\u0435<\/a> \u043a\u0430\u0440\u0434\u0438\u043d\u0430\u043b\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B0%D1%81%D0%BF%D0%B0%D1%80%D1%80%D0%B8,_%D0%9F%D1%8C%D0%B5%D1%82%D1%80%D0%BE\" title=\"\u0413\u0430\u0441\u043f\u0430\u0440\u0440\u0438, \u041f\u044c\u0435\u0442\u0440\u043e\">\u041f\u044c\u0435\u0442\u0440\u043e \u0413\u0430\u0441\u043f\u0430\u0440\u0440\u0438<\/a> \u0438 \u043f\u0440\u0435\u043c\u044c\u0435\u0440-\u043c\u0438\u043d\u0438\u0441\u0442\u0440\u043e\u043c \u0418\u0442\u0430\u043b\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D1%83%D1%81%D1%81%D0%BE%D0%BB%D0%B8%D0%BD%D0%B8,_%D0%91%D0%B5%D0%BD%D0%B8%D1%82%D0%BE\" title=\"\u041c\u0443\u0441\u0441\u043e\u043b\u0438\u043d\u0438, \u0411\u0435\u043d\u0438\u0442\u043e\">\u0411. \u041c\u0443\u0441\u0441\u043e\u043b\u0438\u043d\u0438<\/a>, \u0434\u0435\u0439\u0441\u0442\u0432\u043e\u0432\u0430\u0432\u0448\u0438\u043c \u043e\u0442 \u0438\u043c\u0435\u043d\u0438 \u043a\u043e\u0440\u043e\u043b\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B8%D0%BA%D1%82%D0%BE%D1%80_%D0%AD%D0%BC%D0%BC%D0%B0%D0%BD%D1%83%D0%B8%D0%BB_III\" title=\"\u0412\u0438\u043a\u0442\u043e\u0440 \u042d\u043c\u043c\u0430\u043d\u0443\u0438\u043b III\">\u0412\u0438\u043a\u0442\u043e\u0440\u0430 \u042d\u043c\u043c\u0430\u043d\u0443\u0438\u043b\u0430 III<\/a>. \u041f\u0440\u0438\u0432\u0435\u043b\u0438 \u043a \u043f\u0440\u0430\u0432\u043e\u0432\u043e\u043c\u0443 \u0443\u0440\u0435\u0433\u0443\u043b\u0438\u0440\u043e\u0432\u0430\u043d\u0438\u044e \u0432\u0437\u0430\u0438\u043c\u043d\u044b\u0445 \u043f\u0440\u0435\u0442\u0435\u043d\u0437\u0438\u0439 \u043c\u0435\u0436\u0434\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%82%D0%B0%D0%BB%D0%B8%D1%8F\" title=\"\u0418\u0442\u0430\u043b\u0438\u044f\">\u0418\u0442\u0430\u043b\u0438\u0435\u0439<\/a> \u0438 \u0421\u0432\u044f\u0442\u044b\u043c \u041f\u0440\u0435\u0441\u0442\u043e\u043b\u043e\u043c, \u043a \u0440\u0430\u0437\u0440\u0435\u0448\u0435\u043d\u0438\u044e \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B8%D0%BC%D1%81%D0%BA%D0%B8%D0%B9_%D0%B2%D0%BE%D0%BF%D1%80%D0%BE%D1%81\" title=\"\u0420\u0438\u043c\u0441\u043a\u0438\u0439 \u0432\u043e\u043f\u0440\u043e\u0441\">\u0420\u0438\u043c\u0441\u043a\u043e\u0433\u043e \u0432\u043e\u043f\u0440\u043e\u0441\u0430<\/a>\u00bb, \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043e\u0432\u0430\u0432\u0448\u0435\u0433\u043e \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1870_%D0%B3%D0%BE%D0%B4\" title=\"1870 \u0433\u043e\u0434\">1870 \u0433\u043e\u0434\u0430<\/a>; \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0438\u043b\u0438 \u043f\u0440\u0430\u0432\u0430 \u0438 \u043f\u0440\u0438\u0432\u0438\u043b\u0435\u0433\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B8%D0%BC%D1%81%D0%BA%D0%BE-%D0%BA%D0%B0%D1%82%D0%BE%D0%BB%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D1%86%D0%B5%D1%80%D0%BA%D0%BE%D0%B2%D1%8C\" class=\"mw-redirect\" title=\"\u0420\u0438\u043c\u0441\u043a\u043e-\u043a\u0430\u0442\u043e\u043b\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u0446\u0435\u0440\u043a\u043e\u0432\u044c\">\u041a\u0430\u0442\u043e\u043b\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u0446\u0435\u0440\u043a\u0432\u0438<\/a>, \u0435\u0451 \u043f\u043e\u043b\u043e\u0436\u0435\u043d\u0438\u0435 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D1%80%D0%BE%D0%BB%D0%B5%D0%B2%D1%81%D1%82%D0%B2%D0%BE_%D0%98%D1%82%D0%B0%D0%BB%D0%B8%D1%8F_(1861%E2%80%941946)\" title=\"\u041a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u0442\u0432\u043e \u0418\u0442\u0430\u043b\u0438\u044f (1861\u20141946)\">\u0438\u0442\u0430\u043b\u044c\u044f\u043d\u0441\u043a\u043e\u043c \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86_I_(%D0%BA%D0%BD%D1%8F%D0%B7%D1%8C_%D0%9B%D0%B8%D1%85%D1%82%D0%B5%D0%BD%D1%88%D1%82%D0%B5%D0%B9%D0%BD%D0%B0)\" title=\"\u0424\u0440\u0430\u043d\u0446 I (\u043a\u043d\u044f\u0437\u044c \u041b\u0438\u0445\u0442\u0435\u043d\u0448\u0442\u0435\u0439\u043d\u0430)\">\u0424\u0440\u0430\u043d\u0446 I<\/a> \u0441\u0442\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BA%D0%BD%D1%8F%D0%B7%D0%B5%D0%B9_%D0%9B%D0%B8%D1%85%D1%82%D0%B5%D0%BD%D1%88%D1%82%D0%B5%D0%B9%D0%BD\" title=\"\u0421\u043f\u0438\u0441\u043e\u043a \u043a\u043d\u044f\u0437\u0435\u0439 \u041b\u0438\u0445\u0442\u0435\u043d\u0448\u0442\u0435\u0439\u043d\">\u043a\u043d\u044f\u0437\u0435\u043c \u041b\u0438\u0445\u0442\u0435\u043d\u0448\u0442\u0435\u0439\u043d\u0430<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1937_%D0%B3%D0%BE%D0%B4\" title=\"1937 \u0433\u043e\u0434\">1937<\/a>&#160;\u2014 \u0423\u0447\u0440\u0435\u0436\u0434\u0451\u043d \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%80%D0%B4%D0%B5%D0%BD_%D0%9A%D1%83%D0%BB%D1%8C%D1%82%D1%83%D1%80%D1%8B\" title=\"\u041e\u0440\u0434\u0435\u043d \u041a\u0443\u043b\u044c\u0442\u0443\u0440\u044b\">\u041e\u0440\u0434\u0435\u043d \u041a\u0443\u043b\u044c\u0442\u0443\u0440\u044b<\/a>\u00bb&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D0%BF%D0%BE%D0%BD%D0%B8%D1%8F\" title=\"\u042f\u043f\u043e\u043d\u0438\u044f\">\u044f\u043f\u043e\u043d\u0441\u043a\u0438\u0439<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%80%D0%B4%D0%B5%D0%BD\" title=\"\u041e\u0440\u0434\u0435\u043d\">\u043e\u0440\u0434\u0435\u043d<\/a>, \u0432\u0440\u0443\u0447\u0430\u0435\u043c\u044b\u0439 \u0437\u0430 \u0434\u043e\u0441\u0442\u0438\u0436\u0435\u043d\u0438\u044f \u0432 \u043e\u0431\u043b\u0430\u0441\u0442\u0438 \u043a\u0443\u043b\u044c\u0442\u0443\u0440\u044b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1938_%D0%B3%D0%BE%D0%B4\" title=\"1938 \u0433\u043e\u0434\">1938<\/a><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B9%D0%BC_%D0%9B%D0%B8%D1%82%D0%BE%D0%B2%D1%81%D0%BA%D0%BE%D0%B9_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B8\" title=\"\u0421\u0435\u0439\u043c \u041b\u0438\u0442\u043e\u0432\u0441\u043a\u043e\u0439 \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0438\">\u0421\u0435\u0439\u043c \u041b\u0438\u0442\u043e\u0432\u0441\u043a\u043e\u0439 \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0438<\/a> \u043f\u0440\u0438\u043d\u044f\u043b \u0442\u0440\u0435\u0442\u044c\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BD%D1%81%D1%82%D0%B8%D1%82%D1%83%D1%86%D0%B8%D1%8F_%D0%9B%D0%B8%D1%82%D0%B2%D1%8B\" title=\"\u041a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u044f \u041b\u0438\u0442\u0432\u044b\">\u041a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u044e \u041b\u0438\u0442\u0432\u044b<\/a>. \u0412\u0441\u0442\u0443\u043f\u0438\u043b\u0430 \u0432 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/12_%D0%BC%D0%B0%D1%8F\" title=\"12 \u043c\u0430\u044f\">12 \u043c\u0430\u044f<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1938_%D0%B3%D0%BE%D0%B4\" title=\"1938 \u0433\u043e\u0434\">1938 \u0433\u043e\u0434\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/BBC_One\" title=\"BBC One\">BBC Television<\/a> \u0432\u044b\u043f\u0443\u0441\u043a\u0430\u0435\u0442 \u043d\u0430 \u044d\u043a\u0440\u0430\u043d\u044b \u043f\u0435\u0440\u0432\u0443\u044e \u043d\u0430\u0443\u0447\u043d\u043e-\u0444\u0430\u043d\u0442\u0430\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0443\u044e \u0442\u0435\u043b\u0435\u043f\u0435\u0440\u0435\u0434\u0430\u0447\u0443, \u043f\u043e \u043c\u043e\u0442\u0438\u0432\u0430\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D1%83%D1%87%D0%BD%D0%B0%D1%8F_%D1%84%D0%B0%D0%BD%D1%82%D0%B0%D1%81%D1%82%D0%B8%D0%BA%D0%B0\" title=\"\u041d\u0430\u0443\u0447\u043d\u0430\u044f \u0444\u0430\u043d\u0442\u0430\u0441\u0442\u0438\u043a\u0430\">\u043d\u0430\u0443\u0447\u043d\u043e-\u0444\u0430\u043d\u0442\u0430\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0439<\/a> \u043f\u044c\u0435\u0441\u044b, \u043d\u0430\u043f\u0438\u0441\u0430\u043d\u043d\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B0%D0%BF%D0%B5%D0%BA,_%D0%9A%D0%B0%D1%80%D0%B5%D0%BB\" title=\"\u0427\u0430\u043f\u0435\u043a, \u041a\u0430\u0440\u0435\u043b\">\u041a\u0430\u0440\u0435\u043b\u043e\u043c \u0427\u0430\u043f\u0435\u043a\u043e\u043c<\/a> \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/R.U.R.\" title=\"R.U.R.\">R.U.R.<\/a>\u00bb.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1940_%D0%B3%D0%BE%D0%B4\" title=\"1940 \u0433\u043e\u0434\">1940<\/a><ul><li>\u041d\u0430\u0447\u0430\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D0%BD%D0%B8%D1%8F_%D0%9C%D0%B0%D0%BD%D0%BD%D0%B5%D1%80%D0%B3%D0%B5%D0%B9%D0%BC%D0%B0\" title=\"\u041b\u0438\u043d\u0438\u044f \u041c\u0430\u043d\u043d\u0435\u0440\u0433\u0435\u0439\u043c\u0430\">\u043f\u0440\u043e\u0440\u044b\u0432\u0430 \u043b\u0438\u043d\u0438\u0438 \u041c\u0430\u043d\u043d\u0435\u0440\u0433\u0435\u0439\u043c\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B0%D0%B1%D0%BE%D1%87%D0%B5-%D0%BA%D1%80%D0%B5%D1%81%D1%82%D1%8C%D1%8F%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%9A%D1%80%D0%B0%D1%81%D0%BD%D0%B0%D1%8F_%D0%B0%D1%80%D0%BC%D0%B8%D1%8F\" title=\"\u0420\u0430\u0431\u043e\u0447\u0435-\u043a\u0440\u0435\u0441\u0442\u044c\u044f\u043d\u0441\u043a\u0430\u044f \u041a\u0440\u0430\u0441\u043d\u0430\u044f \u0430\u0440\u043c\u0438\u044f\">\u041a\u0440\u0430\u0441\u043d\u043e\u0439 \u0410\u0440\u043c\u0438\u0435\u0439<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%BE-%D1%84%D0%B8%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0_(1939%E2%80%941940)\" title=\"\u0421\u043e\u0432\u0435\u0442\u0441\u043a\u043e-\u0444\u0438\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 (1939\u20141940)\">\u0417\u0438\u043c\u043d\u0435\u0439 \u0432\u043e\u0439\u043d\u0435<\/a>, \u0437\u0430\u0432\u0435\u0440\u0448\u0438\u0432\u0448\u0435\u0433\u043e\u0441\u044f \u043a\u0430\u043f\u0438\u0442\u0443\u043b\u044f\u0446\u0438\u0435\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%B8%D0%BD%D0%BB%D1%8F%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u0424\u0438\u043d\u043b\u044f\u043d\u0434\u0438\u044f\">\u0424\u0438\u043d\u043b\u044f\u043d\u0434\u0438\u0438<\/a>. \u041e\u0441\u043d\u043e\u0432\u043d\u044b\u0435 \u0441\u0438\u043b\u044b \u0431\u044b\u043b\u0438 \u0441\u043e\u0441\u0440\u0435\u0434\u043e\u0442\u043e\u0447\u0435\u043d\u044b \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D0%B5%D0%BB%D1%8C%D1%81%D0%BA%D0%B8%D0%B9_%D0%BF%D0%B5%D1%80%D0%B5%D1%88%D0%B5%D0%B5%D0%BA\" title=\"\u041a\u0430\u0440\u0435\u043b\u044c\u0441\u043a\u0438\u0439 \u043f\u0435\u0440\u0435\u0448\u0435\u0435\u043a\">\u041a\u0430\u0440\u0435\u043b\u044c\u0441\u043a\u043e\u043c \u043f\u0435\u0440\u0435\u0448\u0435\u0439\u043a\u0435<\/a>. \u0412 \u044d\u0442\u043e\u043c \u043d\u0430\u0441\u0442\u0443\u043f\u043b\u0435\u043d\u0438\u0438 \u0441\u043e\u0432\u043c\u0435\u0441\u0442\u043d\u043e \u0441 \u0441\u0443\u0445\u043e\u043f\u0443\u0442\u043d\u044b\u043c\u0438 \u0447\u0430\u0441\u0442\u044f\u043c\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B2%D0%B5%D1%80%D0%BE-%D0%97%D0%B0%D0%BF%D0%B0%D0%B4%D0%BD%D1%8B%D0%B9_%D1%84%D1%80%D0%BE%D0%BD%D1%82_(%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%BE-%D1%84%D0%B8%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0)\" title=\"\u0421\u0435\u0432\u0435\u0440\u043e-\u0417\u0430\u043f\u0430\u0434\u043d\u044b\u0439 \u0444\u0440\u043e\u043d\u0442 (\u0421\u043e\u0432\u0435\u0442\u0441\u043a\u043e-\u0444\u0438\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430)\">\u0421\u0435\u0432\u0435\u0440\u043e-\u0417\u0430\u043f\u0430\u0434\u043d\u043e\u0433\u043e \u0444\u0440\u043e\u043d\u0442\u0430<\/a> \u0434\u0435\u0439\u0441\u0442\u0432\u043e\u0432\u0430\u043b\u0438 \u043a\u043e\u0440\u0430\u0431\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%BB%D1%82%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D1%84%D0%BB%D0%BE%D1%82\" class=\"mw-redirect\" title=\"\u0411\u0430\u043b\u0442\u0438\u0439\u0441\u043a\u0438\u0439 \u0444\u043b\u043e\u0442\">\u0411\u0430\u043b\u0442\u0438\u0439\u0441\u043a\u043e\u0433\u043e \u0444\u043b\u043e\u0442\u0430<\/a> \u0438 \u0441\u043e\u0437\u0434\u0430\u043d\u043d\u043e\u0439 \u0432 \u043e\u043a\u0442\u044f\u0431\u0440\u0435 1939 \u0433\u043e\u0434\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B0%D0%B4%D0%BE%D0%B6%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B5%D0%BD%D0%BD%D0%B0%D1%8F_%D1%84%D0%BB%D0%BE%D1%82%D0%B8%D0%BB%D0%B8%D1%8F\" title=\"\u041b\u0430\u0434\u043e\u0436\u0441\u043a\u0430\u044f \u0432\u043e\u0435\u043d\u043d\u0430\u044f \u0444\u043b\u043e\u0442\u0438\u043b\u0438\u044f\">\u041b\u0430\u0434\u043e\u0436\u0441\u043a\u043e\u0439 \u0432\u043e\u0435\u043d\u043d\u043e\u0439 \u0444\u043b\u043e\u0442\u0438\u043b\u0438\u0438<\/a>.<\/li><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u0435<\/a> \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043d\u043e <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D0%BE-%D1%81%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%BE%D0%B5_%D1%82%D0%BE%D1%80%D0%B3%D0%BE%D0%B2%D0%BE%D0%B5_%D1%81%D0%BE%D0%B3%D0%BB%D0%B0%D1%88%D0%B5%D0%BD%D0%B8%D0%B5_(1940)&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0413\u0435\u0440\u043c\u0430\u043d\u043e-\u0441\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0435 \u0442\u043e\u0440\u0433\u043e\u0432\u043e\u0435 \u0441\u043e\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u0435 (1940) (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0445\u043e\u0437\u044f\u0439\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0435 \u0441\u043e\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u0435<\/a>  \u043c\u0435\u0436\u0434\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D1%8E%D0%B7_%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%B8%D1%85_%D0%A1%D0%BE%D1%86%D0%B8%D0%B0%D0%BB%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D1%85_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA\" title=\"\u0421\u043e\u044e\u0437 \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u0445 \u0421\u043e\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\">\u0421\u0421\u0421\u0420<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%80%D0%B5%D1%82%D0%B8%D0%B9_%D1%80%D0%B5%D0%B9%D1%85\" title=\"\u0422\u0440\u0435\u0442\u0438\u0439 \u0440\u0435\u0439\u0445\">\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0435\u0439<\/a>. \u0421\u043e\u0433\u043b\u0430\u0441\u043d\u043e \u0434\u043e\u0433\u043e\u0432\u043e\u0440\u0443 \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u0439 \u0421\u043e\u044e\u0437 \u0441\u043e\u0433\u043b\u0430\u0441\u0438\u043b\u0441\u044f \u0441 11 \u0444\u0435\u0432\u0440\u0430\u043b\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1940\" class=\"mw-redirect\" title=\"1940\">1940<\/a> \u0433. \u043f\u043e 11 \u0444\u0435\u0432\u0440\u0430\u043b\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1941\" class=\"mw-redirect\" title=\"1941\">1941<\/a> \u0432 \u0434\u043e\u043f\u043e\u043b\u043d\u0435\u043d\u0438\u0435 \u043a \u043e\u0431\u044a\u0451\u043c\u0430\u043c, \u0443\u043a\u0430\u0437\u0430\u043d\u043d\u044b\u043c \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D0%BE-%D1%81%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%BE%D0%B5_%D1%82%D0%BE%D1%80%D0%B3%D0%BE%D0%B2%D0%BE%D0%B5_%D1%81%D0%BE%D0%B3%D0%BB%D0%B0%D1%88%D0%B5%D0%BD%D0%B8%D0%B5_(1939)\" title=\"\u0413\u0435\u0440\u043c\u0430\u043d\u043e-\u0441\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0435 \u0442\u043e\u0440\u0433\u043e\u0432\u043e\u0435 \u0441\u043e\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u0435 (1939)\">\u0442\u043e\u0440\u0433\u043e\u0432\u043e\u043c \u0434\u043e\u0433\u043e\u0432\u043e\u0440\u0435 1939<\/a>, \u043f\u043e\u0441\u0442\u0430\u0432\u0438\u0442\u044c \u0442\u043e\u0432\u0430\u0440\u043e\u0432 (\u043d\u0435\u0444\u0442\u0438, \u0441\u044b\u0440\u044c\u044f, \u043c\u0443\u043a\u0438) \u043d\u0430 \u0441\u0443\u043c\u043c\u0443 \u043e\u0442 420 \u0434\u043e 430 \u043c\u0438\u043b\u043b\u0438\u043e\u043d\u043e\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D0%B9%D1%85%D1%81%D0%BC%D0%B0%D1%80%D0%BA%D0%B0\" title=\"\u0420\u0435\u0439\u0445\u0441\u043c\u0430\u0440\u043a\u0430\">\u0440\u0435\u0439\u0445\u0441\u043c\u0430\u0440\u043e\u043a<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1941_%D0%B3%D0%BE%D0%B4\" title=\"1941 \u0433\u043e\u0434\">1941<\/a>&#160;\u2014 \u041f\u043b\u0430\u0441\u0442\u0438\u043d\u043a\u0430 \u0441 \u0437\u0430\u043f\u0438\u0441\u044c\u044e \u043f\u0435\u0441\u043d\u0438 \u0438\u0437 \u0440\u0435\u043f\u0435\u0440\u0442\u0443\u0430\u0440\u0430 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B6%D0%B0%D0%B7\" title=\"\u0414\u0436\u0430\u0437\">\u0434\u0436\u0430\u0437<\/a>-\u043e\u0440\u043a\u0435\u0441\u0442\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B8%D0%BB%D0%BB%D0%B5%D1%80,_%D0%93%D0%BB%D0%B5%D0%BD%D0%BD\" title=\"\u041c\u0438\u043b\u043b\u0435\u0440, \u0413\u043b\u0435\u043d\u043d\">\u0413\u043b\u0435\u043d\u043d\u0430 \u041c\u0438\u043b\u043b\u0435\u0440\u0430<\/a>, \u0438\u0437\u0432\u0435\u0441\u0442\u043d\u0430\u044f \u043f\u043e \u043a\u0438\u043d\u043e\u0444\u0438\u043b\u044c\u043c\u0443 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D1%80%D0%B5%D0%BD%D0%B0%D0%B4%D0%B0_%D1%81%D0%BE%D0%BB%D0%BD%D0%B5%D1%87%D0%BD%D0%BE%D0%B9_%D0%B4%D0%BE%D0%BB%D0%B8%D0%BD%D1%8B\" title=\"\u0421\u0435\u0440\u0435\u043d\u0430\u0434\u0430 \u0441\u043e\u043b\u043d\u0435\u0447\u043d\u043e\u0439 \u0434\u043e\u043b\u0438\u043d\u044b\">\u0421\u0435\u0440\u0435\u043d\u0430\u0434\u0430 \u0421\u043e\u043b\u043d\u0435\u0447\u043d\u043e\u0439 \u0434\u043e\u043b\u0438\u043d\u044b<\/a>\u00bb, \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B0%D1%82%D1%82%D0%B0%D0%BD%D1%83%D0%B3%D0%B0_%D0%A7%D1%83-%D1%87%D1%83\" title=\"\u0427\u0430\u0442\u0442\u0430\u043d\u0443\u0433\u0430 \u0427\u0443-\u0447\u0443\">\u041f\u043e\u0435\u0437\u0434 \u043d\u0430 \u0427\u0430\u0442\u0442\u0430\u043d\u0443\u0433\u0443<\/a>\u00bb, \u0441\u0442\u0430\u043b\u0430 \u043f\u0435\u0440\u0432\u044b\u043c \u043e\u0444\u0438\u0446\u0438\u0430\u043b\u044c\u043d\u044b\u043c \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D1%80%D1%82%D0%B8%D1%84%D0%B8%D0%BA%D0%B0%D1%86%D0%B8%D0%B8_%D0%BC%D1%83%D0%B7%D1%8B%D0%BA%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D1%85_%D0%BF%D1%80%D0%BE%D0%B8%D0%B7%D0%B2%D0%B5%D0%B4%D0%B5%D0%BD%D0%B8%D0%B9\" title=\"\u0421\u0435\u0440\u0442\u0438\u0444\u0438\u043a\u0430\u0446\u0438\u0438 \u043c\u0443\u0437\u044b\u043a\u0430\u043b\u044c\u043d\u044b\u0445 \u043f\u0440\u043e\u0438\u0437\u0432\u0435\u0434\u0435\u043d\u0438\u0439\">\u0437\u043e\u043b\u043e\u0442\u044b\u043c \u0434\u0438\u0441\u043a\u043e\u043c<\/a>\u00bb \u0432 \u0438\u0441\u0442\u043e\u0440\u0438\u0438 \u0433\u0440\u0430\u043c\u0437\u0430\u043f\u0438\u0441\u0438. \u0412 \u0442\u043e\u0442 \u0434\u0435\u043d\u044c, \u0432\u043e \u0432\u0440\u0435\u043c\u044f \u0440\u0430\u0434\u0438\u043e\u0442\u0440\u0430\u043d\u0441\u043b\u044f\u0446\u0438\u0438 \u0432\u044b\u0441\u0442\u0443\u043f\u043b\u0435\u043d\u0438\u044f \u043e\u0440\u043a\u0435\u0441\u0442\u0440\u0430, \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/RCA_Records\" title=\"RCA Records\">\u0410\u0440-\u0441\u0438-\u044d\u0439<\/a>\u00bb \u0423\u043e\u043b\u043b\u0438 \u042d\u0440\u043b\u0438 \u0432\u0440\u0443\u0447\u0438\u043b \u0413\u043b\u0435\u043d\u043d\u0443 \u041c\u0438\u043b\u043b\u0435\u0440\u0443 \u043f\u043e\u043a\u0440\u044b\u0442\u0443\u044e \u0437\u043e\u043b\u043e\u0442\u044b\u043c \u043b\u0430\u043a\u043e\u043c \u0433\u0440\u0430\u043c\u043f\u043b\u0430\u0441\u0442\u0438\u043d\u043a\u0443 \u0441 \u0437\u0430\u043f\u0438\u0441\u044c\u044e \u043f\u0435\u0441\u043d\u0438 \u00ab\u041f\u043e\u0435\u0437\u0434 \u043d\u0430 \u0427\u0430\u0442\u0442\u0430\u043d\u0443\u0433\u0443\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1942_%D0%B3%D0%BE%D0%B4\" title=\"1942 \u0433\u043e\u0434\">1942<\/a>&#160;\u2014 \u041d\u0430\u0447\u0430\u043b\u0430\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%BF%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D1%8F_%C2%AB%D0%A6%D0%B5%D1%80%D0%B1%D0%B5%D1%80%C2%BB\" title=\"\u041e\u043f\u0435\u0440\u0430\u0446\u0438\u044f \u00ab\u0426\u0435\u0440\u0431\u0435\u0440\u00bb\">\u041e\u043f\u0435\u0440\u0430\u0446\u0438\u044f \u00ab\u0426\u0435\u0440\u0431\u0435\u0440\u00bb<\/a> \u043f\u043e \u043f\u0435\u0440\u0435\u0434\u0438\u0441\u043b\u043e\u043a\u0430\u0446\u0438\u0438 \u0442\u0440\u0451\u0445 \u043a\u0440\u0443\u043f\u043d\u044b\u0445 \u043d\u0430\u0434\u0432\u043e\u0434\u043d\u044b\u0445 \u043a\u043e\u0440\u0430\u0431\u043b\u0435\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D0%B8%D0%B3%D1%81%D0%BC%D0%B0%D1%80%D0%B8%D0%BD%D0%B5\" title=\"\u041a\u0440\u0438\u0433\u0441\u043c\u0430\u0440\u0438\u043d\u0435\">\u041a\u0440\u0438\u0433\u0441\u043c\u0430\u0440\u0438\u043d\u0435<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/Scharnhorst_(1936)\" title=\"Scharnhorst (1936)\">\u00abScharnhorst\u00bb<\/a> (\u0444\u043b\u0430\u0433 \u0432\u0438\u0446\u0435-\u0430\u0434\u043c\u0438\u0440\u0430\u043b\u0430 \u0426\u0438\u043b\u0438\u0430\u043a\u0441\u0430, \u043a\u0430\u043f\u0438\u0442\u0430\u043d 1 \u0440\u0430\u043d\u0433\u0430 \u0425\u043e\u0444\u0444\u043c\u0430\u043d\u043d), <a href=\"https:\/\/ru.wikipedia.org\/wiki\/Gneisenau_(1936)\" title=\"Gneisenau (1936)\">\u00abGneisenau\u00bb<\/a> (\u043a\u0430\u043f\u0438\u0442\u0430\u043d \u041e\u0442\u0442\u043e \u0424\u0430\u0439\u043d), <a href=\"https:\/\/ru.wikipedia.org\/wiki\/Prinz_Eugen_(1938)\" title=\"Prinz Eugen (1938)\">\u00abPrinz Eugen\u00bb<\/a>) \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%B5%D1%81%D1%82_(%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F)\" title=\"\u0411\u0440\u0435\u0441\u0442 (\u0424\u0440\u0430\u043d\u0446\u0438\u044f)\">\u0411\u0440\u0435\u0441\u0442\u0430<\/a> \u0432 \u0413\u0435\u0440\u043c\u0430\u043d\u0438\u044e.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1943_%D0%B3%D0%BE%D0%B4\" title=\"1943 \u0433\u043e\u0434\">1943<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D0%B0%D0%BB%D0%B8%D0%BD,_%D0%98%D0%BE%D1%81%D0%B8%D1%84_%D0%92%D0%B8%D1%81%D1%81%D0%B0%D1%80%D0%B8%D0%BE%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0421\u0442\u0430\u043b\u0438\u043d, \u0418\u043e\u0441\u0438\u0444 \u0412\u0438\u0441\u0441\u0430\u0440\u0438\u043e\u043d\u043e\u0432\u0438\u0447\">\u0421\u0442\u0430\u043b\u0438\u043d<\/a> \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043b \u0440\u0435\u0448\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D1%8B%D0%B9_%D0%BA%D0%BE%D0%BC%D0%B8%D1%82%D0%B5%D1%82_%D0%BE%D0%B1%D0%BE%D1%80%D0%BE%D0%BD%D1%8B\" title=\"\u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u043a\u043e\u043c\u0438\u0442\u0435\u0442 \u043e\u0431\u043e\u0440\u043e\u043d\u044b\">\u0413\u041a\u041e<\/a> \u043e \u043d\u0430\u0447\u0430\u043b\u0435 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D1%8E%D0%B7_%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%B8%D1%85_%D0%A1%D0%BE%D1%86%D0%B8%D0%B0%D0%BB%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D1%85_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA\" title=\"\u0421\u043e\u044e\u0437 \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u0445 \u0421\u043e\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\">\u0421\u0421\u0421\u0420<\/a> \u0440\u0430\u0431\u043e\u0442 \u0434\u043b\u044f \u0441\u043e\u0437\u0434\u0430\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D0%B4%D0%B5%D1%80%D0%BD%D0%BE%D0%B5_%D0%BE%D1%80%D1%83%D0%B6%D0%B8%D0%B5\" title=\"\u042f\u0434\u0435\u0440\u043d\u043e\u0435 \u043e\u0440\u0443\u0436\u0438\u0435\">\u0430\u0442\u043e\u043c\u043d\u043e\u0439 \u0431\u043e\u043c\u0431\u044b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1944_%D0%B3%D0%BE%D0%B4\" title=\"1944 \u0433\u043e\u0434\">1944<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D0%B2%D0%BD%D0%BE-%D0%9B%D1%83%D1%86%D0%BA%D0%B0%D1%8F_%D0%BE%D0%BF%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D1%8F\" title=\"\u0420\u043e\u0432\u043d\u043e-\u041b\u0443\u0446\u043a\u0430\u044f \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u044f\">\u0420\u043e\u0432\u043d\u043e-\u041b\u0443\u0446\u043a\u0430\u044f \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u044f<\/a>: \u0437\u0430\u0432\u0435\u0440\u0448\u0438\u043b\u0430\u0441\u044c \u0420\u043e\u0432\u043d\u043e-\u041b\u0443\u0446\u043a\u0430\u044f \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u044f, \u043d\u0430\u0447\u0430\u0432\u0448\u0430\u044f\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/27_%D1%8F%D0%BD%D0%B2%D0%B0%D1%80%D1%8F\" title=\"27 \u044f\u043d\u0432\u0430\u0440\u044f\">27 \u044f\u043d\u0432\u0430\u0440\u044f<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1944_%D0%B3%D0%BE%D0%B4\" title=\"1944 \u0433\u043e\u0434\">1944 \u0433\u043e\u0434\u0430<\/a>. \u0412\u043e\u0439\u0441\u043a\u0430 \u043f\u0440\u0430\u0432\u043e\u0433\u043e \u0444\u043b\u0430\u043d\u0433\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/60-%D1%8F_%D0%B0%D1%80%D0%BC%D0%B8%D1%8F_(%D0%A1%D0%A1%D0%A1%D0%A0)\" title=\"60-\u044f \u0430\u0440\u043c\u0438\u044f (\u0421\u0421\u0421\u0420)\">60-\u0439 \u0430\u0440\u043c\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1-%D0%B9_%D0%A3%D0%BA%D1%80%D0%B0%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%84%D1%80%D0%BE%D0%BD%D1%82\" title=\"1-\u0439 \u0423\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u0438\u0439 \u0444\u0440\u043e\u043d\u0442\">1-\u0433\u043e \u0423\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u043e\u0433\u043e \u0444\u0440\u043e\u043d\u0442\u0430<\/a>, \u043f\u043e\u0441\u043b\u0435 \u043e\u0436\u0435\u0441\u0442\u043e\u0447\u0435\u043d\u043d\u044b\u0445 \u0431\u043e\u0435\u0432 \u043e\u0441\