BD%D1%8B%D0%B9_%D1%81%D0%B0%D0%BC%D0%BE%D0%BB%D1%91%D1%82\" title=\"\u0412\u043e\u0435\u043d\u043d\u043e-\u0442\u0440\u0430\u043d\u0441\u043f\u043e\u0440\u0442\u043d\u044b\u0439 \u0441\u0430\u043c\u043e\u043b\u0451\u0442\">\u0432\u043e\u0435\u043d\u043d\u043e-\u0442\u0440\u0430\u043d\u0441\u043f\u043e\u0440\u0442\u043d\u043e\u0433\u043e \u0441\u0430\u043c\u043e\u043b\u0451\u0442\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD-8\" title=\"\u0410\u043d-8\">\u0410\u043d-8<\/a> \u043f\u043e\u0434 \u0443\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u0435\u043c \u043b\u0451\u0442\u0447\u0438\u043a\u043e\u0432-\u0438\u0441\u043f\u044b\u0442\u0430\u0442\u0435\u043b\u0435\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D1%80%D0%BD%D0%B8%D0%BA%D0%BE%D0%B2,_%D0%AF%D0%BA%D0%BE%D0%B2_%D0%98%D0%BB%D1%8C%D0%B8%D1%87\" title=\"\u0412\u0435\u0440\u043d\u0438\u043a\u043e\u0432, \u042f\u043a\u043e\u0432 \u0418\u043b\u044c\u0438\u0447\">\u042f.&#160;\u0418.&#160;\u0412\u0435\u0440\u043d\u0438\u043a\u043e\u0432\u0430<\/a> (\u043a\u043e\u043c\u0430\u043d\u0434\u0438\u0440) \u0438 \u0412.&#160;\u041f.&#160;\u0412\u0430\u0441\u0438\u043d\u0430 (\u0432\u0442\u043e\u0440\u043e\u0439 \u043f\u0438\u043b\u043e\u0442) \u0441 \u0430\u044d\u0440\u043e\u0434\u0440\u043e\u043c\u0430 \u0421\u0432\u044f\u0442\u043e\u0448\u0438\u043d\u043e.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1959_%D0%B3%D0%BE%D0%B4\" title=\"1959 \u0433\u043e\u0434\">1959<\/a>&#160;\u2014 \u0412 \u044e\u0436\u043d\u043e\u0439 \u0447\u0430\u0441\u0442\u0438 \u0410\u0440\u0430\u0432\u0438\u0439\u0441\u043a\u043e\u0433\u043e \u043f\u043e\u043b\u0443\u043e\u0441\u0442\u0440\u043e\u0432\u0430 \u0438\u0437 \u043d\u0435\u0441\u043a\u043e\u043b\u044c\u043a\u0438\u0445 \u0431\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u0438\u0445 \u043a\u043e\u043b\u043e\u043d\u0438\u0439 \u0441\u043e\u0437\u0434\u0430\u043d\u0430 <a href=\"https:\/\/en.wikipedia.org\/wiki\/Federation_of_Arab_Emirates_of_the_South\" class=\"extiw\" title=\"en:Federation of Arab Emirates of the South\">\u0424\u0435\u0434\u0435\u0440\u0430\u0446\u0438\u044f \u0410\u0440\u0430\u0431\u0441\u043a\u0438\u0445 \u042d\u043c\u0438\u0440\u0430\u0442\u043e\u0432 \u042e\u0433\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1970_%D0%B3%D0%BE%D0%B4\" title=\"1970 \u0433\u043e\u0434\">1970<\/a>&#160;\u2014 \u0432\u044b\u0432\u0435\u0434\u0435\u043d \u043d\u0430 \u043e\u0440\u0431\u0438\u0442\u0443 \u043f\u0435\u0440\u0432\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D0%BF%D0%BE%D0%BD%D0%B8%D1%8F\" title=\"\u042f\u043f\u043e\u043d\u0438\u044f\">\u044f\u043f\u043e\u043d\u0441\u043a\u0438\u0439<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D0%BA%D1%83%D1%81%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D1%8B%D0%B9_%D1%81%D0%BF%D1%83%D1%82%D0%BD%D0%B8%D0%BA_%D0%97%D0%B5%D0%BC%D0%BB%D0%B8\" title=\"\u0418\u0441\u043a\u0443\u0441\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u0441\u043f\u0443\u0442\u043d\u0438\u043a \u0417\u0435\u043c\u043b\u0438\">\u0438\u0441\u043a\u0443\u0441\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u0441\u043f\u0443\u0442\u043d\u0438\u043a \u0417\u0435\u043c\u043b\u0438<\/a> \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%81%D1%83%D0%BC%D0%B8_(%D1%81%D0%BF%D1%83%D1%82%D0%BD%D0%B8%D0%BA)\" title=\"\u041e\u0441\u0443\u043c\u0438 (\u0441\u043f\u0443\u0442\u043d\u0438\u043a)\">\u041e\u0441\u0443\u043c\u0438<\/a>\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1971_%D0%B3%D0%BE%D0%B4\" title=\"1971 \u0433\u043e\u0434\">1971<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u0435<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D1%88%D0%B8%D0%BD%D0%B3%D1%82%D0%BE%D0%BD_(%D0%BE%D0%BA%D1%80%D1%83%D0%B3_%D0%9A%D0%BE%D0%BB%D1%83%D0%BC%D0%B1%D0%B8%D1%8F)\" class=\"mw-redirect\" title=\"\u0412\u0430\u0448\u0438\u043d\u0433\u0442\u043e\u043d (\u043e\u043a\u0440\u0443\u0433 \u041a\u043e\u043b\u0443\u043c\u0431\u0438\u044f)\">\u0412\u0430\u0448\u0438\u043d\u0433\u0442\u043e\u043d\u0435<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D0%BD%D0%B4%D0%BE%D0%BD\" title=\"\u041b\u043e\u043d\u0434\u043e\u043d\">\u041b\u043e\u043d\u0434\u043e\u043d\u0435<\/a> \u0431\u044b\u043b \u043e\u0442\u043a\u0440\u044b\u0442 \u0434\u043b\u044f \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043d\u0438\u044f \u00ab\u0414\u043e\u0433\u043e\u0432\u043e\u0440 \u043e \u0437\u0430\u043f\u0440\u0435\u0449\u0435\u043d\u0438\u0438 \u0440\u0430\u0437\u043c\u0435\u0449\u0435\u043d\u0438\u044f \u043d\u0430 \u0434\u043d\u0435 \u043c\u043e\u0440\u0435\u0439 \u0438 \u043e\u043a\u0435\u0430\u043d\u043e\u0432 \u0438 \u0432 \u0435\u0433\u043e \u043d\u0435\u0434\u0440\u0430\u0445 \u044f\u0434\u0435\u0440\u043d\u043e\u0433\u043e \u043e\u0440\u0443\u0436\u0438\u044f\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1972_%D0%B3%D0%BE%D0%B4\" title=\"1972 \u0433\u043e\u0434\">1972<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B4%D0%BC%D0%B8%D0%BD%D0%B8%D1%81%D1%82%D1%80%D0%B0%D1%82%D0%B8%D0%B2%D0%BD%D0%BE%D0%B5_%D0%B4%D0%B5%D0%BB%D0%B5%D0%BD%D0%B8%D0%B5_%D0%9E%D0%B1%D1%8A%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D1%85_%D0%90%D1%80%D0%B0%D0%B1%D1%81%D0%BA%D0%B8%D1%85_%D0%AD%D0%BC%D0%B8%D1%80%D0%B0%D1%82%D0%BE%D0%B2\" title=\"\u0410\u0434\u043c\u0438\u043d\u0438\u0441\u0442\u0440\u0430\u0442\u0438\u0432\u043d\u043e\u0435 \u0434\u0435\u043b\u0435\u043d\u0438\u0435 \u041e\u0431\u044a\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0445 \u0410\u0440\u0430\u0431\u0441\u043a\u0438\u0445 \u042d\u043c\u0438\u0440\u0430\u0442\u043e\u0432\">\u042d\u043c\u0438\u0440\u0430\u0442<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B0%D1%81-%D1%8D%D0%BB%D1%8C-%D0%A5%D0%B0%D0%B9%D0%BC%D0%B0_(%D1%8D%D0%BC%D0%B8%D1%80%D0%B0%D1%82)\" title=\"\u0420\u0430\u0441-\u044d\u043b\u044c-\u0425\u0430\u0439\u043c\u0430 (\u044d\u043c\u0438\u0440\u0430\u0442)\">\u0420\u0430\u0441-\u044d\u043b\u044c-\u0425\u0430\u0439\u043c\u0430<\/a> \u043f\u0440\u0438\u0441\u043e\u0435\u0434\u0438\u043d\u0438\u043b\u0441\u044f \u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%B1%D1%8A%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D0%B5_%D0%90%D1%80%D0%B0%D0%B1%D1%81%D0%BA%D0%B8%D0%B5_%D0%AD%D0%BC%D0%B8%D1%80%D0%B0%D1%82%D1%8B\" title=\"\u041e\u0431\u044a\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0435 \u0410\u0440\u0430\u0431\u0441\u043a\u0438\u0435 \u042d\u043c\u0438\u0440\u0430\u0442\u044b\">\u041e\u0431\u044a\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u043c \u0410\u0440\u0430\u0431\u0441\u043a\u0438\u043c \u042d\u043c\u0438\u0440\u0430\u0442\u0430\u043c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1975_%D0%B3%D0%BE%D0%B4\" title=\"1975 \u0433\u043e\u0434\">1975<\/a>&#160;\u2014 \u0412\u043e \u0432\u0442\u043e\u0440\u043e\u043c \u0442\u0443\u0440\u0435 \u0432\u044b\u0431\u043e\u0440\u043e\u0432 \u043f\u0440\u0435\u0434\u0441\u0435\u0434\u0430\u0442\u0435\u043b\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BD%D1%81%D0%B5%D1%80%D0%B2%D0%B0%D1%82%D0%B8%D0%B2%D0%BD%D0%B0%D1%8F_%D0%BF%D0%B0%D1%80%D1%82%D0%B8%D1%8F_%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D0%B8\" title=\"\u041a\u043e\u043d\u0441\u0435\u0440\u0432\u0430\u0442\u0438\u0432\u043d\u0430\u044f \u043f\u0430\u0440\u0442\u0438\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438\">\u041a\u043e\u043d\u0441\u0435\u0440\u0432\u0430\u0442\u0438\u0432\u043d\u043e\u0439 \u043f\u0430\u0440\u0442\u0438\u0438 \u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%8D%D1%82%D1%87%D0%B5%D1%80,_%D0%9C%D0%B0%D1%80%D0%B3%D0%B0%D1%80%D0%B5%D1%82\" title=\"\u0422\u044d\u0442\u0447\u0435\u0440, \u041c\u0430\u0440\u0433\u0430\u0440\u0435\u0442\">\u041c\u0430\u0440\u0433\u0430\u0440\u0435\u0442 \u0422\u044d\u0442\u0447\u0435\u0440<\/a> \u043e\u0434\u0435\u0440\u0436\u0430\u043b\u0430 \u043f\u043e\u0431\u0435\u0434\u0443 \u043d\u0430\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D0%B0%D0%B9%D1%82%D0%BB%D0%BE%D1%83,_%D0%A3%D0%B8%D0%BB%D1%8C%D1%8F%D0%BC\" title=\"\u0423\u0430\u0439\u0442\u043b\u043e\u0443, \u0423\u0438\u043b\u044c\u044f\u043c\">\u0423\u0438\u043b\u044c\u044f\u043c\u043e\u043c \u0423\u0430\u0439\u0442\u043b\u043e\u0443<\/a>, \u0441\u0442\u0430\u0432 \u043f\u0435\u0440\u0432\u043e\u0439 \u0436\u0435\u043d\u0449\u0438\u043d\u043e\u0439&#160;\u2014 \u043b\u0438\u0434\u0435\u0440\u043e\u043c \u043e\u043f\u043f\u043e\u0437\u0438\u0446\u0438\u0438 \u0432 \u0411\u0440\u0438\u0442\u0430\u043d\u0438\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1978_%D0%B3%D0%BE%D0%B4\" title=\"1978 \u0433\u043e\u0434\">1978<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D1%82%D0%B0%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%9D%D0%B0%D1%80%D0%BE%D0%B4%D0%BD%D0%B0%D1%8F_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0\" title=\"\u041a\u0438\u0442\u0430\u0439\u0441\u043a\u0430\u044f \u041d\u0430\u0440\u043e\u0434\u043d\u0430\u044f \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\">\u041a\u0438\u0442\u0430\u0435<\/a> \u043e\u0442\u043c\u0435\u043d\u0451\u043d \u0437\u0430\u043f\u0440\u0435\u0442 \u043d\u0430 \u0447\u0442\u0435\u043d\u0438\u0435 \u043a\u043d\u0438\u0433 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%80%D0%B8%D1%81%D1%82%D0%BE%D1%82%D0%B5%D0%BB%D1%8C\" title=\"\u0410\u0440\u0438\u0441\u0442\u043e\u0442\u0435\u043b\u044c\">\u0410\u0440\u0438\u0441\u0442\u043e\u0442\u0435\u043b\u044f<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B5%D0%BA%D1%81%D0%BF%D0%B8%D1%80,_%D0%A3%D0%B8%D0%BB%D1%8C%D1%8F%D0%BC\" title=\"\u0428\u0435\u043a\u0441\u043f\u0438\u0440, \u0423\u0438\u043b\u044c\u044f\u043c\">\u0428\u0435\u043a\u0441\u043f\u0438\u0440\u0430<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B8%D0%BA%D0%BA%D0%B5%D0%BD%D1%81,_%D0%A7%D0%B0%D1%80%D0%BB%D1%8C%D0%B7\" title=\"\u0414\u0438\u043a\u043a\u0435\u043d\u0441, \u0427\u0430\u0440\u043b\u044c\u0437\">\u0414\u0438\u043a\u043a\u0435\u043d\u0441\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1979_%D0%B3%D0%BE%D0%B4\" title=\"1979 \u0433\u043e\u0434\">1979<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D0%BB%D0%B0%D0%BC%D1%81%D0%BA%D0%B0%D1%8F_%D1%80%D0%B5%D0%B2%D0%BE%D0%BB%D1%8E%D1%86%D0%B8%D1%8F_%D0%B2_%D0%98%D1%80%D0%B0%D0%BD%D0%B5\" title=\"\u0418\u0441\u043b\u0430\u043c\u0441\u043a\u0430\u044f \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u044f \u0432 \u0418\u0440\u0430\u043d\u0435\">\u0418\u0441\u043b\u0430\u043c\u0441\u043a\u0430\u044f \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u044f \u0432 \u0418\u0440\u0430\u043d\u0435<\/a>: \u043f\u043e\u0441\u043b\u0435 \u0442\u0440\u0451\u0445 \u0441\u0443\u0442\u043e\u043a \u0443\u043b\u0438\u0447\u043d\u044b\u0445 \u0431\u043e\u0451\u0432 \u0441 \u043b\u043e\u044f\u043b\u044c\u043d\u044b\u043c\u0438 \u0432\u0440\u0435\u043c\u0435\u043d\u043d\u043e\u043c\u0443 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0443 \u0433\u0432\u0430\u0440\u0434\u0435\u0439\u0446\u0430\u043c\u0438 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B5%D0%B3%D0%B5%D1%80%D0%B0%D0%BD\" title=\"\u0422\u0435\u0433\u0435\u0440\u0430\u043d\">\u0422\u0435\u0433\u0435\u0440\u0430\u043d\u0435<\/a> \u0441\u0442\u043e\u0440\u043e\u043d\u043d\u0438\u043a\u0438 \u0430\u044f\u0442\u043e\u043b\u043b\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%BE%D0%BC%D0%B5%D0%B9%D0%BD%D0%B8\" class=\"mw-redirect\" title=\"\u0425\u043e\u043c\u0435\u0439\u043d\u0438\">\u0425\u043e\u043c\u0435\u0439\u043d\u0438<\/a> \u0431\u0435\u0440\u0443\u0442 \u043a\u043e\u043d\u0442\u0440\u043e\u043b\u044c \u043d\u0430\u0434 \u0433\u043e\u0440\u043e\u0434\u043e\u043c, \u0413\u0435\u043d\u0448\u0442\u0430\u0431 \u043e\u0431\u044a\u044f\u0432\u043b\u044f\u0435\u0442 \u043d\u0435\u0439\u0442\u0440\u0430\u043b\u0438\u0442\u0435\u0442, \u043f\u043e\u0431\u0435\u0434\u0430 \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1980_%D0%B3%D0%BE%D0%B4\" title=\"1980 \u0433\u043e\u0434\">1980<\/a>&#160;\u2014 \u041f\u0440\u0435\u043c\u044c\u0435\u0440\u0430 \u0444\u0438\u043b\u044c\u043c\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D0%BD%D1%8C%D1%88%D0%BE%D0%B2,_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80_%D0%92%D0%B0%D0%BB%D0%B5%D0%BD%D1%82%D0%B8%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041c\u0435\u043d\u044c\u0448\u043e\u0432, \u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440 \u0412\u0430\u043b\u0435\u043d\u0442\u0438\u043d\u043e\u0432\u0438\u0447\">\u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440\u0430 \u041c\u0435\u043d\u044c\u0448\u043e\u0432\u0430<\/a> \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0_%D1%81%D0%BB%D0%B5%D0%B7%D0%B0%D0%BC_%D0%BD%D0%B5_%D0%B2%D0%B5%D1%80%D0%B8%D1%82\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430 \u0441\u043b\u0435\u0437\u0430\u043c \u043d\u0435 \u0432\u0435\u0440\u0438\u0442\">\u041c\u043e\u0441\u043a\u0432\u0430 \u0441\u043b\u0435\u0437\u0430\u043c \u043d\u0435 \u0432\u0435\u0440\u0438\u0442<\/a>\u00bb. \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1981_%D0%B3%D0%BE%D0%B4_%D0%B2_%D0%BA%D0%B8%D0%BD%D0%BE\" title=\"1981 \u0433\u043e\u0434 \u0432 \u043a\u0438\u043d\u043e\">1981 \u0433\u043e\u0434\u0443<\/a> \u0444\u0438\u043b\u044c\u043c \u0443\u0434\u043e\u0441\u0442\u043e\u0435\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%81%D0%BA%D0%B0%D1%80_(%D0%BF%D1%80%D0%B5%D0%BC%D0%B8%D1%8F)\" class=\"mw-redirect\" title=\"\u041e\u0441\u043a\u0430\u0440 (\u043f\u0440\u0435\u043c\u0438\u044f)\">\u043a\u0438\u043d\u043e\u043f\u0440\u0435\u043c\u0438\u0438 \u00ab\u041e\u0441\u043a\u0430\u0440\u00bb<\/a> \u043a\u0430\u043a \u043b\u0443\u0447\u0448\u0438\u0439 \u0444\u0438\u043b\u044c\u043c \u043d\u0430 \u0438\u043d\u043e\u0441\u0442\u0440\u0430\u043d\u043d\u043e\u043c \u044f\u0437\u044b\u043a\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1981_%D0%B3%D0%BE%D0%B4\" title=\"1981 \u0433\u043e\u0434\">1981<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D0%BD%D0%B5%D1%80%D0%B0%D0%BB_%D0%B0%D1%80%D0%BC%D0%B8%D0%B8_(%D0%9F%D0%BE%D0%BB%D1%8C%D1%88%D0%B0)\" title=\"\u0413\u0435\u043d\u0435\u0440\u0430\u043b \u0430\u0440\u043c\u0438\u0438 (\u041f\u043e\u043b\u044c\u0448\u0430)\">\u0413\u0435\u043d\u0435\u0440\u0430\u043b \u0430\u0440\u043c\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D1%80%D1%83%D0%B7%D0%B5%D0%BB%D1%8C%D1%81%D0%BA%D0%B8%D0%B9,_%D0%92%D0%BE%D0%B9%D1%86%D0%B5%D1%85_%D0%92%D0%B8%D1%82%D0%BE%D0%BB%D1%8C%D0%B4\" class=\"mw-redirect\" title=\"\u042f\u0440\u0443\u0437\u0435\u043b\u044c\u0441\u043a\u0438\u0439, \u0412\u043e\u0439\u0446\u0435\u0445 \u0412\u0438\u0442\u043e\u043b\u044c\u0434\">\u0412\u043e\u0439\u0446\u0435\u0445 \u0412\u0438\u0442\u043e\u043b\u044c\u0434 \u042f\u0440\u0443\u0437\u0435\u043b\u044c\u0441\u043a\u0438\u0439<\/a> \u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B5%D0%BC%D1%8C%D0%B5%D1%80-%D0%BC%D0%B8%D0%BD%D0%B8%D1%81%D1%82%D1%80_%D0%9F%D0%BE%D0%BB%D1%8C%D1%88%D0%B8\" title=\"\u041f\u0440\u0435\u043c\u044c\u0435\u0440-\u043c\u0438\u043d\u0438\u0441\u0442\u0440 \u041f\u043e\u043b\u044c\u0448\u0438\">\u043f\u0440\u0435\u0434\u0441\u0435\u0434\u0430\u0442\u0435\u043b\u0435\u043c \u0421\u043e\u0432\u0435\u0442\u0430 \u041c\u0438\u043d\u0438\u0441\u0442\u0440\u043e\u0432 \u041f\u041d\u0420<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1986_%D0%B3%D0%BE%D0%B4\" title=\"1986 \u0433\u043e\u0434\">1986<\/a>&#160;\u2014 \u041d\u0430 \u043c\u043e\u0441\u0442\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BB%D0%B8%D0%BD%D0%B8%D0%BA%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D0%BE%D1%81%D1%82\" title=\"\u0413\u043b\u0438\u043d\u0438\u043a\u0441\u043a\u0438\u0439 \u043c\u043e\u0441\u0442\">\u0413\u043b\u0438\u043d\u0438\u043a\u0435<\/a>, \u043d\u0430 \u0433\u0440\u0430\u043d\u0438\u0446\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B0%D0%BF%D0%B0%D0%B4%D0%BD%D1%8B%D0%B9_%D0%91%D0%B5%D1%80%D0%BB%D0%B8%D0%BD\" title=\"\u0417\u0430\u043f\u0430\u0434\u043d\u044b\u0439 \u0411\u0435\u0440\u043b\u0438\u043d\">\u0417\u0430\u043f\u0430\u0434\u043d\u043e\u0433\u043e \u0411\u0435\u0440\u043b\u0438\u043d\u0430<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%94%D0%A0\" class=\"mw-redirect\" title=\"\u0413\u0414\u0420\">\u0413\u0414\u0420<\/a>, \u043f\u0440\u043e\u0438\u0437\u0432\u0435\u0434\u0451\u043d \u043e\u0431\u043c\u0435\u043d \u0430\u0440\u0435\u0441\u0442\u043e\u0432\u0430\u043d\u043d\u044b\u0445 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a> \u0447\u0435\u0445\u043e\u0441\u043b\u043e\u0432\u0430\u0446\u043a\u0438\u0445 \u0430\u0433\u0435\u043d\u0442\u043e\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%91%D1%85%D0%B5%D1%80,_%D0%9A%D0%B0%D1%80%D0%B5%D0%BB\" title=\"\u041a\u0451\u0445\u0435\u0440, \u041a\u0430\u0440\u0435\u043b\">\u041a\u0430\u0440\u0435\u043b\u0430 \u041a\u0451\u0445\u0435\u0440\u0430<\/a> \u0438 \u0425\u0430\u043d\u0443 \u041a\u0451\u0445\u0435\u0440, \u0430 \u0442\u0430\u043a\u0436\u0435 \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0433\u043e \u0440\u0430\u0437\u0432\u0435\u0434\u0447\u0438\u043a\u0430 \u0415\u0432\u0433\u0435\u043d\u0438\u044f \u0417\u0435\u043c\u043b\u044f\u043a\u043e\u0432\u0430, \u043f\u043e\u043b\u044c\u0441\u043a\u043e\u0433\u043e \u0440\u0430\u0437\u0432\u0435\u0434\u0447\u0438\u043a\u0430 \u0415\u0436\u0438 \u041a\u0430\u0447\u043c\u0430\u0440\u0435\u043a\u0430 \u0438 \u0440\u0430\u0437\u0432\u0435\u0434\u0447\u0438\u043a\u0430 \u0413\u0414\u0420 \u0414\u0435\u0442\u043b\u0435\u0444\u0430 \u0428\u0430\u0440\u0444\u0435\u043d\u043e\u0440\u0442\u0430, \u0430\u0440\u0435\u0441\u0442\u043e\u0432\u0430\u043d\u043d\u044b\u0445 \u0432 \u0424\u0420\u0413, \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B0%D0%B2%D0%BE%D0%B7%D0%B0%D1%89%D0%B8%D1%82%D0%BD%D0%B8%D0%BA%D0%B8\" title=\"\u041f\u0440\u0430\u0432\u043e\u0437\u0430\u0449\u0438\u0442\u043d\u0438\u043a\u0438\">\u0431\u043e\u0440\u0446\u0430 \u0437\u0430 \u043f\u0440\u0430\u0432\u0430 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0421\u0421\u0421\u0420\">\u0421\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u043c \u0421\u043e\u044e\u0437\u0435<\/a>, \u0438\u0437\u0432\u0435\u0441\u0442\u043d\u043e\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B8%D1%81%D1%81%D0%B8%D0%B4%D0%B5%D0%BD%D1%82\" title=\"\u0414\u0438\u0441\u0441\u0438\u0434\u0435\u043d\u0442\">\u0434\u0438\u0441\u0441\u0438\u0434\u0435\u043d\u0442\u0430<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%82%D0%BA%D0%B0%D0%B7%D0%BD%D0%B8%D0%BA_(%D1%8D%D0%BC%D0%B8%D0%B3%D1%80%D0%B0%D1%86%D0%B8%D1%8F)\" title=\"\u041e\u0442\u043a\u0430\u0437\u043d\u0438\u043a (\u044d\u043c\u0438\u0433\u0440\u0430\u0446\u0438\u044f)\">\u043e\u0442\u043a\u0430\u0437\u043d\u0438\u043a\u0430<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B8%D0%BE%D0%BD%D0%B8%D1%81%D1%82\" class=\"mw-redirect\" title=\"\u0421\u0438\u043e\u043d\u0438\u0441\u0442\">\u0441\u0438\u043e\u043d\u0438\u0441\u0442\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A9%D0%B0%D1%80%D0%B0%D0%BD%D1%81%D0%BA%D0%B8%D0%B9,_%D0%9D%D0%B0%D1%82%D0%B0%D0%BD\" title=\"\u0429\u0430\u0440\u0430\u043d\u0441\u043a\u0438\u0439, \u041d\u0430\u0442\u0430\u043d\">\u0410\u043d\u0430\u0442\u043e\u043b\u0438\u044f \u0411\u043e\u0440\u0438\u0441\u043e\u0432\u0438\u0447\u0430 \u0429\u0430\u0440\u0430\u043d\u0441\u043a\u043e\u0433\u043e<\/a>, \u0432\u043c\u0435\u0441\u0442\u0435 \u0441 \u0434\u0432\u0443\u043c\u044f \u0433\u0440\u0430\u0436\u0434\u0430\u043d\u0430\u043c\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%A0%D0%93\" class=\"mw-redirect\" title=\"\u0424\u0420\u0413\">\u0424\u0420\u0413<\/a> \u0438 \u0433\u0440\u0430\u0436\u0434\u0430\u043d\u0438\u043d\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B5%D1%85%D0%BE%D1%81%D0%BB%D0%BE%D0%B2%D0%B0%D0%BA%D0%B8%D1%8F\" title=\"\u0427\u0435\u0445\u043e\u0441\u043b\u043e\u0432\u0430\u043a\u0438\u044f\">\u0427\u0435\u0445\u043e\u0441\u043b\u043e\u0432\u0430\u043a\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1990_%D0%B3%D0%BE%D0%B4\" title=\"1990 \u0433\u043e\u0434\">1990<\/a>&#160;\u2014 \u041f\u043e\u0441\u043b\u0435 \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043d\u0438\u044f \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u0438\u043c \u0431\u0435\u043b\u044b\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B5%D0%B7%D0%B8%D0%B4%D0%B5%D0%BD%D1%82_%D0%AE%D0%90%D0%A0\" class=\"mw-redirect\" title=\"\u041f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 \u042e\u0410\u0420\">\u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u043e\u043c \u042e\u0410\u0420<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BB%D0%B5%D1%80%D0%BA,_%D0%A4%D1%80%D0%B5%D0%B4%D0%B5%D1%80%D0%B8%D0%BA_%D0%92%D0%B8%D0%BB%D0%BB%D0%B5%D0%BC_%D0%B4%D0%B5\" title=\"\u041a\u043b\u0435\u0440\u043a, \u0424\u0440\u0435\u0434\u0435\u0440\u0438\u043a \u0412\u0438\u043b\u043b\u0435\u043c \u0434\u0435\">\u0424\u0440\u0435\u0434\u0435\u0440\u0438\u043a\u043e\u043c \u0434\u0435 \u041a\u043b\u0435\u0440\u043a\u043e\u043c<\/a> \u0443\u043a\u0430\u0437\u0430 \u043e \u043b