0%B1%D0%B0%D0%BD%D0%B3%D1%83%D0%BB%D1%8B_%D0%9C%D1%8F%D0%BB%D0%B8%D0%BA%D0%B3%D1%83%D0%BB%D1%8B%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0411\u0435\u0440\u0434\u044b\u043c\u0443\u0445\u0430\u043c\u0435\u0434\u043e\u0432, \u0413\u0443\u0440\u0431\u0430\u043d\u0433\u0443\u043b\u044b \u041c\u044f\u043b\u0438\u043a\u0433\u0443\u043b\u044b\u0435\u0432\u0438\u0447\">\u0413\u0443\u0440\u0431\u0430\u043d\u0433\u0443\u043b\u044b \u041c\u044f\u043b\u0438\u043a\u0433\u0443\u043b\u044b\u0435\u0432\u0438\u0447 \u0411\u0435\u0440\u0434\u044b\u043c\u0443\u0445\u0430\u043c\u0435\u0434\u043e\u0432<\/a> \u043f\u043e\u0431\u0435\u0434\u0438\u043b \u043d\u0430 \u0432\u044b\u0431\u043e\u0440\u0430\u0445 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B5%D0%B7%D0%B8%D0%B4%D0%B5%D0%BD%D1%82_%D0%A2%D1%83%D1%80%D0%BA%D0%BC%D0%B5%D0%BD%D0%B8%D0%B8\" title=\"\u041f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 \u0422\u0443\u0440\u043a\u043c\u0435\u043d\u0438\u0438\">\u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%83%D1%80%D0%BA%D0%BC%D0%B5%D0%BD%D0%B8%D1%8F\" title=\"\u0422\u0443\u0440\u043a\u043c\u0435\u043d\u0438\u044f\">\u0422\u0443\u0440\u043a\u043c\u0435\u043d\u0438\u0438<\/a> \u0441 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u043e\u043c 89,23&#160;%.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2008_%D0%B3%D0%BE%D0%B4\" title=\"2008 \u0433\u043e\u0434\">2008<\/a><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B5%D0%B7%D0%B8%D0%B4%D0%B5%D0%BD%D1%82_%D0%92%D0%BE%D1%81%D1%82%D0%BE%D1%87%D0%BD%D0%BE%D0%B3%D0%BE_%D0%A2%D0%B8%D0%BC%D0%BE%D1%80%D0%B0\" title=\"\u041f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 \u0412\u043e\u0441\u0442\u043e\u0447\u043d\u043e\u0433\u043e \u0422\u0438\u043c\u043e\u0440\u0430\">\u041f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 \u0412\u043e\u0441\u0442\u043e\u0447\u043d\u043e\u0433\u043e \u0422\u0438\u043c\u043e\u0440\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B0%D0%BC%D1%83%D1%88-%D0%9E%D1%80%D1%82%D0%B0,_%D0%96%D0%BE%D0%B7%D0%B5\" title=\"\u0420\u0430\u043c\u0443\u0448-\u041e\u0440\u0442\u0430, \u0416\u043e\u0437\u0435\">\u0416\u043e\u0437\u0435 \u0420\u0430\u043c\u0443\u0448-\u041e\u0440\u0442\u0430<\/a> \u0431\u044b\u043b \u0442\u044f\u0436\u0435\u043b\u043e \u0440\u0430\u043d\u0435\u043d \u0432 \u0436\u0438\u0432\u043e\u0442 \u0432 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0435 <a href=\"https:\/\/en.wikipedia.org\/wiki\/2008_East_Timorese_assassination_attempts\" class=\"extiw\" title=\"en:2008 East Timorese assassination attempts\">\u043f\u043e\u043a\u0443\u0448\u0435\u043d\u0438\u044f<\/a>, \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u043e\u0432\u0430\u043d\u043d\u043e\u0433\u043e \u044d\u043a\u0441\u0442\u0440\u0435\u043c\u0438\u0441\u0442\u0441\u043a\u043e\u0439 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0435\u0439 \u0431\u043e\u0435\u0432\u0438\u043a\u043e\u0432 \u0412\u043e\u0441\u0442\u043e\u0447\u043d\u043e\u0433\u043e \u0422\u0438\u043c\u043e\u0440\u0430. \u0412\u0440\u0430\u0447\u0438 \u043a\u043e\u043d\u0441\u0442\u0430\u0442\u0438\u0440\u043e\u0432\u0430\u043b\u0438 2-3 \u0440\u0430\u043d\u0435\u043d\u0438\u044f, \u043e\u0441\u043e\u0431\u0435\u043d\u043d\u043e \u0441\u0438\u043b\u044c\u043d\u043e \u0431\u044b\u043b\u043e \u0437\u0430\u0434\u0435\u0442\u043e \u043f\u0440\u0430\u0432\u043e\u0435 \u043b\u0451\u0433\u043a\u043e\u0435.<\/li><li>\u0412 \u0421\u0435\u0443\u043b\u0435, \u0432 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0435 \u043f\u043e\u0436\u0430\u0440\u0430, \u0441\u0433\u043e\u0440\u0435\u043b\u0430 \u0434\u043e\u0442\u043b\u0430 \u0434\u0435\u0440\u0435\u0432\u044f\u043d\u043d\u0430\u044f \u0447\u0430\u0441\u0442\u044c \u043e\u0434\u043d\u043e\u0433\u043e \u0438\u0437 \u0441\u0442\u0430\u0440\u0435\u0439\u0448\u0438\u0445 \u0430\u0440\u0445\u0438\u0442\u0435\u043a\u0442\u0443\u0440\u043d\u044b\u0445 